INSERT INTO `catalogsearch_fulltext` (`fulltext_id`, `product_id`, `store_id`, `data_index`) VALUES
(304, 27, 1, 'Enabled|Taxable Goods|Trumpet|N15 Belt|Jones|||An ivory belt by Augusta Jones. Has a rhinestone clasp that can either be worn in the front or the back. Can be altered smaller by a professional seamstress. Length 29", width 1.5".|Started in 1999 by Charlotte Leung, the Augusta Jones style is defined by contemporary clean lines with a twist - usually in the form of an unexpected bejeweled detail. Successful from the start, this young company has been awarded three British Bridal finalist awards within the first two years of introducing the label. Their work is regularly featured editorially in Cosmopolitan Bride, In-Style Wedding, Brides, Wedding &amp; Home, and You &amp; Your Wedding.|100|1'),
(305, 28, 1, 'Enabled|Taxable Goods|Trumpet|"Selecta" Ostrich Feather Shrug|Glamorous-Elegant|Vintage-Style|Lightweight|Manuel Mota|||Add fun and interest to your gown with this shrug by Manuel Mota. It has been decorated with organza and Gaza "petals" as well as ostrich feathers.|Manuel Mota of Spain is the designer and director of the Pronovias, the world''s leading bridal house. He and more than seventy others, make sure to be up on the hottest and most unique trends, fabrics, styles, etc. Now a group and not made up of one designer, Pronovias offers countless amount of designs, customizations, and accessories.|1500|1'),
(306, 29, 1, 'Enabled|Taxable Goods|Trumpet|Dolce &amp;amp; Gabbana|White Patent Leather Shoes|||You must complete your bridal look with the perfect shoes! These beautiful D&amp;G heels are both stylish and sophisticated.|Dolce &amp; Gabbana is a leading company in the end high fashion design world. Run by Italian designs Domenico Dolce and Stefano Gabbana, this luxurious design house in Milan is loved by many for their exquisite designs and impeccable quality.|385|1'),
(299, 22, 1, 'Enabled|Taxable Goods|Trumpet|Haute Bride|H010|||This exquisite crystal hairpin has just the right amount of glam to spice up your look. Wear it with a veil or alone in an up-do, but either way this piece will shine. Measuring 2 1/4" by 2 1/2" on a twisted metal comb.||245|1'),
(300, 23, 1, 'Enabled|Taxable Goods|Trumpet|Meg Jewelry|"Regina" Earrings|||With a 1 1/2" drop, these pearl and Swarovski crystal earrings will beautifully accessorize your gown. Made from sterling silver.|All MEG bridal jewelry designs are made in the United States in eco-friendly environments.|90|1'),
(301, 24, 1, 'Enabled|Taxable Goods|Trumpet|Tejani|Round Pearl Necklace, B0662|||Round silhouette necklace with four cascading strands of man-made pearls accentuated by a floral-shaped girandole finely crafted in cubic zirconia and pearls. Set in brass with rhodium plating (shown in silver finish). * Adjustable 14-17&rdquo; long * Lobster closure * Imported||229|1'),
(302, 25, 1, 'Enabled|Taxable Goods|Trumpet|Paris Tiaras|"Grand Tour"|||Three strands of pearls and two shell shaped rhinestone incrusted clasps make up this beautiful antique-like bracelet. Bracelet measures 6.75" from clasp to clasp.||308|1'),
(298, 21, 1, 'Enabled|Taxable Goods|A-Line|Straight|Sample|Strapless|#7117|Glamorous-Elegant|Romantic-Feminine|Heavier|Shiny|Structured|Simone Carvalli|Apple|Full Bust|Hour Glass|Inverted Triangle|||This romantic dress has a mix between both modern and vintage details. The pleated bodice is accented with beautiful lace and beaded appliques that hit the silhouette at flattering places. No need for adding a sash or detailing, this gown has it all from the draped skirt to long train.|Simone Carvalli is an excellent designer of bridal gowns who finds inspiration in the Victorian era and modernizes it to create unique and luxurious gowns to fit the modern bride. Voluminous accents, rich fabrics, and heavy decorations adorn the gowns|2400|1'),
(297, 20, 1, 'Enabled|Taxable Goods|Ball Gown|Sweetheart|Sample|Strapless|Two Osiris|Glamorous-Elegant|Romantic-Feminine|Lightweight|Sheer|Structured|Rosa Clara|Full Bust|Hour Glass|Inverted Triangle|||This unique Rosa Clara design features a beautiful pleated sweetheart bodice embellished with a floral rhinestone applique at the empire waist. The romantic rosette detailed skirt adds to the glamor of this gown. Fabric covered buttons line the center back of the gown and create a polished and refined look.|Rosa Clara is a pioneer in incorporating fashion into bridal collections, as well as in using top quality fabrics. After creating the Rosa Clara Group in 1995, Clara has recruited some of the most prestigious designers from Spain and other countries around the world to ffer brides the opportunity to find the perfect gown of their dreams.|2400|1'),
(296, 19, 1, 'Enabled|Taxable Goods|Trumpet|Halter|Sample|Not Strapless|#9812|Glamorous-Elegant|Modern-Chic|Shiny|Structured|Alvina Valenta|Full Bust|Hour Glass|Straight and Narrow|||From the Spring 2008 collection comes this chic halter top gown designed from silk duchess satin and silk organza. Has a low back with covered rear buttons that extend to the end of the sweep train and a trumpet skirt. A silk organza bow detail with crystal brooch accents the neckline.|This classic couture collection is designed by Victoria McMillan for JLM Couture. Alvina Valenta gowns are known for their timeless elegance, sophistication and most especially their attention to detail. All of the dresses are finished by hand including the beading and their signature hand rolled roses. McMillan believes the bride should be the main focus of the wedding, and the dress should only enhance her beauty.|2410|1'),
(294, 17, 1, 'Enabled|Taxable Goods|Ball Gown|Scoop|Sample|Strapless|"Adele"|Classic-Traditional|Glamorous-Elegant|Romantic-Feminine|Lightweight|Shiny|Amsale|Apple|Hour Glass|Inverted Triangle|Pear|Straight and Narrow|||This flat front ball gown has beautiful details along with a sleek style. The waistline is accented with a crystal applique and the back is detailed with a large asymmetrical bow. Having slit pockets in the side of the gown, gives it a special and relaxed touch.|Amsale designs are for the bride who wants a clean and modern aesthetic. Understated and classic, Ethiopian-born Amsale believes that every dress has a certain personality to match the right bride. With her clean and perfectly simple gown, Amsale is able to use many different fabrics, textures, and symmetry to enhance a specific bridal look.|4400|1'),
(295, 18, 1, 'Enabled|Taxable Goods|A-Line|Scoop|Sample|Strapless|#9055|Beach-Casual|Classic-Traditional|Romantic-Feminine|Lightweight|Alvina Valenta|Full Bust|Hour Glass|Straight and Narrow|||This Alvina Valenta gown is an understated design with an organic look and feel. The silk fabric gives off a perfect sheen and gives this gown a divine illusion. Much detail of the gown is seen in the pleated bodice and ruched waist that is finished with a layered and raw edgedfl oral applique. The feminine skirt floats beautifully down to the floor.|This classic couture collection is designed by Victoria McMillan for JLM Couture. Alvina Valenta gowns are known for their timeless elegance, sophistication and most especially their attention to detail. All of the dresses are finished by hand including the beading and their signature hand rolled roses. McMillan believes the bride should be the main focus of the wedding, and the dress should only enhance her beauty.|2700|1'),
(293, 16, 1, 'Enabled|Taxable Goods|A-Line|One Shoulder|New|Not Strapless|5''0&quot;|"Kelly"|Beach-Casual|Romantic-Feminine|Flowing|Lightweight|Sheer|Jones|Hour Glass|Straight and Narrow|||Float down the aisle in this light and simple gown by Augusta Jones. The aline organza skirt flows over a sheath underskirt. Ruching on the bodice provides interest and a flattering fit. The floral strap is unattached and can be easily stitched on in whichever way your heart desires (either shoulder or even as a belt). The sample of this gown shows a lace skirt which has been eliminated from this custom design. Complete with an inner corset which helps to accentuate the waistline.|Started in 1999 by Charlotte Leung, the Augusta Jones style is defined by contemporary clean lines with a twist - usually in the form of an unexpected bejeweled detail. Successful from the start, this young company has been awarded three British Bridal finalist awards within the first two years of introducing the label. Their work is regularly featured editorially in Cosmopolitan Bride, In-Style Wedding, Brides, Wedding &amp; Home, and You &amp; Your Wedding.|2298|1'),
(292, 15, 1, 'Enabled|Taxable Goods|Mermaid|Sweetheart|Nearly-New|Strapless|2|5''8&quot;|"Ethereal"|Glamorous-Elegant|Romantic-Feminine|Flowing|Lightweight|Sheer|Kenneth Poole|Hour Glass|Straight and Narrow|||This gown lives up to its name "Ethereal". Whimsical and glamorous, this dress features a draped bodice atop a floating skirt, both perfectly accented with silver floral embroidery. This perfect silhouette make to create a flattering figure and a beautiful bridal look. Complete with a built in bustle to dance the night away.|Kenneth Poole was started in 2003 by the popular Amsale Aberra who has an eponymous bridal line - See Amsale. With Kenneth Pool, Aberra seeks to create dramatic gowns with luxurious fabrics and intricate beadwork. Kenneth Pool gowns are showstoppers!|5000|1'),
(291, 14, 1, 'Enabled|Taxable Goods|A-Line|Scoop|Nearly-New|Strapless|"Juno"|Glamorous-Elegant|Modern-Chic|Romantic-Feminine|Flowing|Heavier|Shiny|Junko Yoshioka|Apple|Pear|||As seen on the cover of Brides Magazine! The sleek bodice is separated from the fanciful layered skirt by a beautiful silk ribbon to accentuate the waist. Ruffles give the back of this dress added dimension and flare. This dress has effortless style. The back adornment is not as visible from the front as it looks in the pictures -- shown this way as the zipper did not completely zip due to the large size of the dress form. Complete with a bustle.|Born and raised in Japan and now established in New York,, Junko Yoshioka has been designing since a young age. Recognized for her creative designs and versatile use of fabrics, Yoshioka has not only dressed countless brides, but also carries a long celebrity clientele. Hand made appliques as well as asymmetrical lines and varieties of textures can be seen in her designs.|4400|1'),
(290, 13, 1, 'Enabled|Taxable Goods|Mermaid|Sweetheart|New|Not Strapless|#12469|Modern-Chic|Romantic-Feminine|Lightweight|Sheer|Vera Wang|||Be modernly romantic in this incredible Vera Wang design. Made from ruched tulle, this gown is unique and fresh while perfectly showing off that great figure. A flower or hair piece could be paired beautifully with this gown to match the organza rosettes filled with crystals clustered around one strap. The skirt is dripping with cascading pressed pleat tulle ruffles that ensure that you will stand out on your big day. Do not let this brilliant design get away!|Vera Wang - This former Vogue editor, turned high-end designer is now a household name. After over 20 years of opening her first salon doors, Vera Wang is loved now more than ever. Known for her amazing draping and use of different fabrics, Wang stays true to her original and confident designs.|7500|1'),
(264, 12, 1, 'Trumpet|Enabled|Taxable Goods|Rhinestone Hair Comb w/ Gold Finish|Add a touch of glamour to your look with this rhinestone beaded comb that has an antique gold finish. Can be worn on top of your head as a small tiara or tucked in a back hair design. Width is 4" and height is 1". Adjustable 2.5" twisted metal comb.||225|0'),
(263, 11, 1, 'Enabled|Nearly-New|Strapless|Sweetheart|Ball Gown|Taxable Goods|Bijou|Amsale|Shiny|Structured|Classic-Traditional|Modern-Chic|Color: Ivory Collection Year: Fall 2010 Silhouette: Ball gown Fabric: 100% silk taffeta and silk organza Neckline: Strapless sweetheart Waist: Dropped Train: Court Receipt: Yes From Amsale Aberra''s Blue Label Collection comes "Bijou" a soft silk taffeta ball gown. "Bijou''s" flattering ruched bodice flows into a multidimensional full skirt adorned with hand-made taffeta and organza flowers. It is sure to surprise and delight your groom and guests. Only a select number of gowns are chosen each year for the Blue Label Collection. These gowns are more complex in their construction, requiring more involved work and higher utilization of finer fabrics. Each gown is created individually and carries a signature blue label with the AMSALE ABERRA logo. Our gown is complete with a bustle and a blue bow sewn in the interior bodice for your "something blue".|Amsale designs are for the bride who wants a clean and modern aesthetic. Understated and classic, Ethiopian-born Amsale believes that every dress has a certain personality to match the right bride. With her clean and perfectly simple gown, Amsale is able to use many different fabrics, textures, and symmetry to enhance a specific bridal look.|8800|1'),
