(284, 10, 1, 'Enabled|New|Strapless|Sweetheart|Trumpet|Taxable Goods|Lazaro 3161|||Color: Ivory Fabric: Shell is 100% Silk Organza Silhouette: Ball Gown Neckline: Sweetheart Strapless Waist: Natural Train: Chapel Collection: Fall 2011 Original Receipt: yes This stunning gown by Lazaro features a full skirt decorated with silk organza petals that give it volume and texture. Just the right amount of large crystals accent the skirt while the jewel encrusted bodice sparkles. The sheer bodice was ordered lined (an extra charge of $175), but can easily be removed if the original look is preferred. A very special gown. Shown here with a fingertip length one layer veil, Haute Bride Crystal Hair Pin H010, and Judd Waddell Mauve Satin Sash. All sold separately.||5425|0'),
