(324, 30, 1, 'Halter|Not Strapless|Mermaid|2|5''8&quot;|Nearly-New|Enabled|Taxable Goods|LF217|Glamorous-Elegant|Modern-Chic|Lightweight|Shiny|Anne Barge|Hour Glass|Straight and Narrow|||This sexy, yet sweet Anne Barge gown accents an all pleated elongated torso atop a pickup and draped skirt. Finished with a bubble hem and mini box pleats, this gown is light and fun. The delicate halter straps wraps around the gown to feature a v-back and beautiful fabric covered buttons. Flattering in silhouette and rich in fabric, this gown is sure to wow your crowd.|Launched in 1999, the Anne Barge Bridal Collection combines classic designs in the finest of silks with museum quality beading and embroidery, not before seen in the worldwide bridal market. The Anne Barge bride is a timeless beauty.|3500|1'),
(325, 31, 1, 'One Shoulder|Not Strapless|Trumpet|4|5''5&amp;&quot;|Nearly-New|Enabled|Taxable Goods|#8955|Beach-Casual|Romantic-Feminine|Flowing|Lightweight|Sheer|Jim Hjelm|Hour Glass|Straight and Narrow|||This beautifully unique design by Jim Hjelm is a show stopper hands down! With its gently draped bodice and organza overlay skirt, this gown is one that will float down the aisle with you. Great for an outdoor wedding, this gown has a one shoulder spaghetti strap that is detailed with organza floral appliques and a touch of rhinestones and crystals. Complete with a built in underskirt and bustle.|Designer of Jim Hjelm Bridal, California native, and Otis design school alumnis, Francesca Pitera was formally the senior designer for St. John. After finally following her passion for bridal, Pitera now designs innovative and fresh gowns in the most luxurious fabrics.|2100|1'),
