(323, 33, 1, 'Sweetheart|Strapless|Trumpet|2|5''8&quot;|Nearly-New|Enabled|Taxable Goods|"Tiffany"|Glamorous-Elegant|Romantic-Feminine|Lightweight|Sheer|Structured|Somsi Couture|Full Bust|Hour Glass|Straight and Narrow|||A glamorous and fun gown by Somsi Couture, this 2 piece gown was designed from the softest silk organza and silk chiffon. On the top, layers of organza sit playfully above ruched chiffon. Silk netting and a flower crystal brooch accent the empire waist line. The tiered organza skirt beautifully fits through the hips and then flares. This gown is more than worthy of a walk down the red carpet....or white aisle. Photos of this dress on a bride can be viewed on our blog.|All Somsi Couture gowns are made in the USA and have hand-finished details worthy of a couture house. Born in Malaysia, Somsi&rsquo;s passion for fashion, love for beautiful things, and constant search and demand for uniqueness, has led her to designing collections of absolutely unique one-of-a-kind gowns for a fashion savvy bride.|4800|1'),
(330, 34, 1, 'Sweetheart|Strapless|Trumpet|2|5''9&quot;|Nearly-New|Enabled|Taxable Goods|"Annette"|Classic-Traditional|Glamorous-Elegant|Heavier|Shiny|Ulla Maija|Straight and Narrow|||This ducchess satin gown is bias cut to beautifully drape as it does in the bustled skirt. Complete with pearl buttons lining the zipper, this wedding dress is glamorous and classy.|Built on the concept of luxury, Ulla Maija is wholeheartedly a couture bridal house. From Eastern France, designer Anna Maier knows the creativity, detail, and techniques it takes to produce a unique and quality gown. Beauty is found in every Maija design.|4600|1'),
(335, 35, 1, 'Sweetheart|Strapless|Trumpet|4|5''9&quot;|New|Enabled|Taxable Goods|"Kristen"|Classic-Traditional|Romantic-Feminine|Vintage-Style|Matte|Structured|Valena Valentina|Full Bust|Hour Glass|Straight and Narrow|||Kristen features an asymmetrical pleated bodice atop a trumpet skirt. The bodice has the perfect touch of hand placed Alencon lace. The back of the gown "wow" with a unique pleated skirt and train, low back, and fabric covered buttons.|Designer Elena Ham, of Va Lena Valentina, is a European San Diego based designer. Inspired by her mother and strong femininity, Elena believes in every woman feeling like a queen on her wedding day. Her designs feature distinct details and alluring lines all to accent a classic look and a woman''s natural beauty.|3520|1'),
(339, 36, 1, 'Sweetheart|Strapless|Ball Gown|6|5''8&quot;|Nearly-New|Enabled|Taxable Goods|"Bijou"|Romantic-Feminine|Lightweight|Structured|Amsale|Full Bust|Inverted Triangle|Pear|||From Amsale Aberra''s Blue Label Collection comes "Bijou" a soft silk taffeta ball gown. "Bijou''s" flattering ruched bodice flows into a multidimensional full skirt adorned with hand-made taffeta and organza flowers. It is sure to surprise and delight your groom and guests.|Amsale designs are for the bride who wants a clean and modern aesthetic. Understated and classic, Ethiopian-born Amsale believes that every dress has a certain personality to match the right bride. With her clean and perfectly simple gown, Amsale is able to use many different fabrics, textures, and symmetry to enhance a specific bridal look. Only a select number of gowns are chosen each year for the Blue Label Collection. These gowns are more complex in their construction, requiring more involved work and higher utilization of finer fabrics. Each gown is created individually and carries a signature blue label with the AMSALE ABERRA logo. Our gown is complete with a bustle and a blue bow sewn in the interior bodice for your "something blue".|8800|1'),
(343, 37, 1, 'Straight|Strapless|Trumpet|6|5''8&quot;|Nearly-New|Enabled|Taxable Goods|#32906|Beach-Casual|Modern-Chic|Flowing|Lightweight|Sheer|Herrera|Apple|Hour Glass|Inverted Triangle|Pear|Petite|Straight and Narrow|||This sweet and youthful Carolina Herrera gown features a strapless bodice enhanced by ruffles sitting perfectly atop a light and floating pleated aline skirt. Separated by a gathered sash at the natural waist, this silhouette and silk polka dot jacquard are both comfortable and whimsical.|Carolina Herrera became a household name after designing a wedding dress for Caroline Kennedy. Her gowns are both decidedly simplistic and works for art. She often surprises with rich and interesting fabrics, painted detailing, lace appliques and jacquard patters. Her designs depict elegance and intricacy without losing the appearance of simplicity.|4590|1'),
(347, 38, 1, 'Sweetheart|Strapless|Trumpet|6|5''7&quot;|Nearly-New|Enabled|Taxable Goods|"Joy"|Beach-Casual|Romantic-Feminine|Lightweight|Structured|Christos|Hour Glass|Straight and Narrow|||This elegant gown has a very organic and fresh look and feel from the rouched bodice to Shantung fabric. With the flattering silhouette a custom added floral appliques accent one hip. Great for an indoor or outdoor wedding, you can accessorize this gown to fit almost any feel.|Christos was established over 20 years ago by Christos Yiannakou and is currently under creative direction the ever-popular bridal designer Amsale Aberra (see AMSALE). Christos gowns evoke a feeling of fairy-tale, femininity, and romance. The finest silk fabrics and French laces are the staples of the collection.|3600|1'),
(352, 39, 1, 'Square|Not Strapless|A-Line|4|5''8&quot;|Nearly-New|Enabled|Taxable Goods|T170|Classic-Traditional|Glamorous-Elegant|Heavier|Shiny|Christos|Full Bust|Hour Glass|Inverted Triangle|||Sophisticated and traditional, this gown features a flattering portrait neckline and off the shoulder sleeves atop a trumpet skirt. Princess lines, luxurious fabric, and an embellished empire waist give this gown both a regal feel and touch.|Christos was established over 20 years ago by Christos Yiannakou and is currently under creative direction the ever-popular bridal designer Amsale Aberra (see AMSALE). Christos gowns evoke a feeling of fairy-tale, femininity, and romance. The finest silk fabrics and French laces are the staples of the collection.|3400|1'),
(358, 40, 1, 'V-Neck|Not Strapless|Sheath|4|6''0&amp;amp;quot;+|Nearly-New|Enabled|Taxable Goods|Hammered Stretch-Satin Skirt & Top|Beach-Casual|Glamorous-Elegant|Modern-Chic|Shiny|Donna Karan|Full Bust|Straight and Narrow|||Sold exclusively at the high fashion e-Boutique, Net-A-Porter, this maxi skirt and wrap effect top by Donna Karan have a modern minimalist look. The bias cut skirt has angled seams and rear zipper while the draped top has a modified racer back to show off your beautiful shoulders. A sophisticated gown perfect for a contemporary city bride. Alterations made: none to the body or length. A small invisible stitch was made to the inside of the top to stop unwanted show.|Donna Karen, high end designer in the fashion industry, brings her high standard of quality and amazing designing into the bridal market to produce exquisite gowns for the classy woman. Rich fabrics and precise cuts can be seen in all the exclusive gowns.|2800|1'),
(363, 41, 1, 'Straight|Strapless|Ball Gown|6|5''6&quot;|New|Enabled|Taxable Goods|#75909|Beach-Casual|Classic-Traditional|Matte|Structured|Douglas Hannant|Hour Glass|Inverted Triangle|Pear|Straight and Narrow|||This Douglas Hannant design is made from the finest silk and creates gorgeous dimension with the pin tuck pleats. This pleats release right at the hip to create a nice full skirt. The corset strapless bust shows off that gorgeous neckline. The dress is a classic and clean and can be worn with versatile jewelry and head pieces. Receipt available upon request.|Born and raised in the Midwest United States, Douglas Hannant worked his way up from the sales floor at Barneys to the Bryant Park runway. Inspired first by an old stockroom mannequin, Hannant has developed in to a high-end bridal designer with clientele around the world. Clean in construction, a urban and chic flare is seen in every one of his designs.|5550|1'),
(368, 42, 1, 'V-Neck|Not Strapless|Sheath|6|5''8&quot;|New|Enabled|Taxable Goods|#8851|Glamorous-Elegant|Romantic-Feminine|Lace|Jim Hjelm|Petite|Straight and Narrow|||This brand new Jim Hjelm design is romantic with a touch of glamor. Covered with a lace overlay, this gown is also adorned with beading and crystals along the empire waist and straps that all lead to a sexy low v-back. This gown is fully lined with a built in bustle. Great for any type of venue and can easily be worn with or without a veil.|Designer of Jim Hjelm Bridal, California native, and Otis design school alumnis, Francesca Pitera was formally the senior designer for St. John. After finally following her passion for bridal, Pitera now designs innovative and fresh gowns in the most luxurious fabrics.|4500|1'),
(373, 43, 1, 'Straight|Strapless|A-Line|4|5''4&quot;|Nearly-New|Enabled|Taxable Goods|Custom Eva II|Classic-Traditional|Lightweight|Shiny|Jin Wang|Hour Glass|Inverted Triangle|Pear|||This custom designed gown based of Jin Wang''s Eva II design features an architectural bodice atop a draped and voluminous skirt. The unconventional contrast makes for a unique and regal look. The alluring and rich fabric gives off the perfect amount of shine and the back of this gown will leave a lasting impression. Finished with an invisible rear zipper and added bustle.|Designer Jin Wang, designs her gowns in remembrance to Old World ateliers. Sewing from a young age, Wang has perfected her craft and is passionate about elegance and enhancing a bride''s beauty with her gowns. Graceful and timeless are two words easily conveying her designs.|4500|1'),
(478, 44, 1, 'Sweetheart|Strapless|Ball Gown|10|5''11&quot;|Sample|Enabled|Taxable Goods|#4051|Classic-Traditional|Romantic-Feminine|Vintage-Style|Lace|Lightweight|Sheer|Judd Waddell|Apple|Hour Glass|Inverted Triangle|Pear|Straight and Narrow|||A full lined petticoat, 2 layers of organza, and 2 layers of netting are the foundational elements of this romantic gown. Alencon lace flows from the bodice down through the skirt An art-deco style beaded "belt" accents the natural waist. This dress is dreamy, light, and flowing.|Judd Waddell&rsquo;s background in architecture is shown directly in his clean and simple designs. Classic and elegant, Waddell&rsquo;s stands firm in his design philosophy that states &ldquo;notice the woman first, the dress second.&rdquo;|3960|1'),
(383, 45, 1, 'One Shoulder|Not Strapless|Trumpet|6|5''11&quot;|New|Enabled|Taxable Goods|#3110|Glamorous-Elegant|Romantic-Feminine|Lightweight|Matte|Lazaro|Full Bust|Hour Glass|Straight and Narrow|||The elongated ruched bodice caresses the figure while the intricately beaded floral chiffon "belt" accents the natural waist on this Lazaro design. A pleated circular skirt adds drama. The finishing details include a crystal and petal accent on one shoulder and rear covered buttons.|Cuba native Lazaro Perez is the very talented and creative designer for both Lazaro and Tara Keely bridal lines. Well known for his exquisite embroidery and hand beading, Lazaro loves the drama and big shapes that a wedding gown can have. Loving what he does, Lazaro can&rsquo;t see himself doing anything else but creating beauty.|3630|1'),
(388, 46, 1, 'Straight|Strapless|A-Line|6|5''6&quot;|New|Enabled|Taxable Goods|"Victoria" #1130|Beach-Casual|Classic-Traditional|Lightweight|Shiny|L''ezu Atelier|Full Bust|Petite|Straight and Narrow|||Understated, yet alluring, this Italian silk satin gown features a hand-draped bodice sitting atop a slightly aline skirt. Finished with an invisible rear zipper and added bustle. This timeless gown is a blank canvas to create your unique look.|Made up of two international designers, Patricia Nevil and Corina Lewinzon, L&rsquo;ezu prides themselves on knowing what silhouette fits each body type. With a market towards sophisticated brides, may designs stem from the silhouettes of the 18th and 19th century with a modern flare. Education across the world, the L&rsquo;ezu designers like to make sure that every construction is like that of the classic couture houses.|2500|1'),
