(399, 48, 1, 'Straight|Not Strapless|Trumpet|4|5''8&quot;|New|Enabled|Taxable Goods|#3908|Glamorous-Elegant|Romantic-Feminine|Vintage-Style|Heavier|Shiny|Structured|Lazaro|Full Bust|Hour Glass|Straight and Narrow|||This sleek and ethereal Lazaro design is one that will stand the test of time. The elongated torso enhanced with a gorgeous belt at the natural waist, will do wonders to your figure as the box pleated skirt gently flares to the floor. The scoop neck shows frames the bust while the back of the gown is complete with fabric covered buttons and a fluid train.|Cuba native Lazaro Perez is the very talented and creative designer for both Lazaro and Tara Keely bridal lines. Well known for his exquisite embroidery and hand beading, Lazaro loves the drama and big shapes that a wedding gown can have. Loving what he does, Lazaro can&rsquo;t see himself doing anything else but creating beauty.|5000|1'),
(404, 49, 1, 'Scoop|Not Strapless|Trumpet|6|5''5&amp;&quot;|Sample|Enabled|Taxable Goods|"Grace"|Classic-Traditional|Romantic-Feminine|Vintage-Style|Shiny|Structured|Lily Samii|Petite|Straight and Narrow|||Just like the princess, Lily Samii''s Grace, has a luxurious sensibility. Designed from the softest and lustrous silk ducchess, this gown is fully lined and impeccably constructed. Keep your look simple and classic or pair with bold accessories.|San Francisco based designer Lily Samii, uses her knowledge of French craftsmanship and years of experience to create high-end designer gowns that cater to the brides today. With extraordinary fabrics, Samii creates gown that are classic and comfortable.|3000|1'),
(551, 50, 1, 'Straight|Strapless|Trumpet|4|5''11&quot;|New|Enabled|Taxable Goods|Melissa Sweet "Mila", Casual Dress Size 4|Beach-Casual|Romantic-Feminine|Flowing|Lightweight|Shiny|Melissa Sweet|Hour Glass|Straight and Narrow|||Color: Ivory Fabric: Silk Taffeta Silhouette: Trumpet Neckline: Strapless Waist: Dropped Train: Chapel This sweet and romantic gown is both timeless and flattering! With a softly ruched bodice and dropped asymmetrical waistline, this dress is perfect for showing of your curves. The draped skirt floats behind you and is enhanced by a hand crafted floral applique. This gown will look as if it were made just for you. Add fabric covered buttons or perfect as is.|Melissa Sweet and Reverie by Melissa Sweet are part of the Priscilla Boston bridal house. This dress collection, like the name, is assuredly "sweet" with whimsical details. The Melissa Sweet bride is fashion forward, feminine, and flirtatious. As the Priscilla of Boston bridal house closed in late 2011, this is your last chance to be a Melissa Sweet bride.|Label Size: 2 Casual Dress Size: 4 Approximate Measurements: 33" bust, 26" waist, 37" hips|3900|1'),
(536, 56, 1, 'Sweetheart|Not Strapless|Sheath|4|5''11&quot;|Sample|Enabled|Taxable Goods|Ristarose "Raquel", Casual Dress Size 4|Beach-Casual|Romantic-Feminine|Flowing|Lightweight|Ristarose|Hour Glass|Pear|Straight and Narrow|||Color: Ivory Hollow to Hem: 38" Color: Diamond white Ristarose Raquel is perfect for your destination wedding, a beach wedding, or even your rehearsal dinner. Beautiful silk chiffon is the foundation for this knee-length dress that has a sweetheart neckline and empire waist. Thin straps criss-cross the low back that ends in covered buttons. Fabric gathering around the buttons and scattered bugle beads add a feminine touch.|Designers Ivana Ristic and Lynn Rosenzweig created Ristarose gowns for the romantic and chic bride. All of their designs are made with top grade silk fabrics and with highest quality craftsmanship including silk linings.||2100|1'),
(533, 58, 1, 'Scoop|Strapless|Ball Gown|4|5''9&quot;|Nearly-New|Enabled|Taxable Goods|St Pucchi #477, Casual Dress Size 4|Glamorous-Elegant|Romantic-Feminine|Flowing|Lightweight|St. Puchhi|Apple|Hour Glass|Inverted Triangle|Pear|Straight and Narrow|||Color: Ivory Silhouette: Ball Gown Fabric: Thai silk taffeta Neckline: Strapless Scoop Waist: Dropped Waist Train: Cathedral From its exquisite embroidery to perfectly placed rosettes, this St. Pucchi design is a true work of art. A heavily embellished scoop neckline dramatically falls into a dropped waist and draped voluminous skirt. Dripping with detail, this gown is quite certain to keep everyone talking. Complete with a bustle.|President and designer of St. Pucchi, Rani Totman is known far and wide for her avant-garde designs that stand out among the masses St. Pucchi serves a very specific niche of brides. Regal in look and luxurious in texture, St. Pucchi gowns can be seen at the most lavish of weddings.|Label Size: 10 Casual Dress Size: 4 Approximate Measurements: 34" bust, 26.5" waist, 36" hips|7990|1'),
(532, 59, 1, 'Straight|Strapless|Ball Gown|4|5''8&quot;|Nearly-New|Enabled|Taxable Goods|St. Pucchi z287, Casual Dress Size 4|Romantic-Feminine|Vintage-Style|Lightweight|Shiny|Structured|St. Puchhi|Apple|Hour Glass|Inverted Triangle|Pear|Straight and Narrow|||Color: Blush Fabric: Thai Silk Taffeta Silhouette: Ball Gown Neckline: Strapless Waist: Dropped Train: Cathedral The time period looking design by St. Pucchi features a corset bodice with noticeable boning and a lace up back. Small ruffles peak out of the strapless top of this gown and functional metal hooks act as an additional closure down the front. Complete with a built in petticoat, the full skirt is gathered at the dropped waist and finished with a bubble hem. The built in bustle creates more beautiful volume. For brides who want a unique wedding dress, this is for you!|President and designer of St. Pucchi, Rani Totman is known for her avant-garde designs that stand out among the masses. St. Pucchi serves a very specific niche of brides. Regal in look and luxurious in texture, St. Pucchi gowns can be seen at the most lavish of weddings.|Label Size: 4 Casual Dress Size: 4 Approximate Measurements: bust 34", waist 26", high hip 32"|5995|1'),
(527, 62, 1, 'Sweetheart|Strapless|A-Line|12|5''7&quot;|Nearly-New|Enabled|Taxable Goods|Marisa 859, Casual Dress Size 12|Beach-Casual|Glamorous-Elegant|Romantic-Feminine|Flowing|Lightweight|Sheer|Marisa|Apple|Full Bust|Hour Glass|Inverted Triangle|Pear|||Color: Light Ivory Collection Year: 2009 Fabric: Organza Silhouette: Modified Aline Neckline: Strapless Sweetheart Waist: Natural Train: Chapel This gown will make you feel like a goddess with its draped bust and layered cascading skirt. The light fabric beautifully flows while the waist beading and appliques helps to show off your figure. Completely lined with a built in underskirt.|Designed by American designer Tamara Kristen, Marisa gowns are classic and proven to be popular styles. All gowns are made from silk with reasonable price points.|Casual Dress Size: 12-14 Approximate Measurements: bust 38", waist 31", hips 42"|2150|1'),
(525, 63, 1, 'Scoop|Strapless|A-Line|12|5''11&quot;|Sample|Enabled|Taxable Goods|Priscilla of Boston 4211, Casual Dress Size 12|Beach-Casual|Classic-Traditional|Glamorous-Elegant|Flowing|Sheer|Priscilla of Boston|Apple|Hour Glass|Inverted Triangle|Pear|Straight and Narrow|||Color: Ivory Fabric: Silk Satin faced Chiffon Silhouette: Slim Aline Neckline: Strapless Scoop Waist: Empire Train: Chapel This ethereal Priscilla of Boston gown fully encompasses a fanciful and sophisticated look. The perfect draped bust sits a top an elaborately beaded waist. A fluid and sleek skirt cascades beautifully, slightly grazing the floor. Both dreamy and elegant, this gown is a show stopper.|Priscilla of Boston was one of the oldest and most established bridal houses in the United States for decades. Priscilla Kidder, the original designer, opened her store on Newbury street in 1945 and designed dresses for many well-known brides. Each gown was designed using couture craftsmanship, modern silhouettes, and unique details to create a classic and timeless style. This is your last chance to wear a Priscilla of Boston gown as they closed their doors in late 2011.|Designer Size: 12; fits true to size. Approximate Measurement: 38" bust, 31" waist, 43" hips|3850|1'),
(554, 67, 1, 'Sweetheart|Not Strapless|Trumpet|8|5''11&quot;|New|Enabled|Taxable Goods|Stephen Yearick #2684x, Casual Dress Size 8|Glamorous-Elegant|Modern-Chic|Romantic-Feminine|Heavier|Shiny|Structured|Stephen Yearick|Full Bust|Hour Glass|Straight and Narrow|||Color: Off-White Fabric: Silk Satin Silhouette: Aline Neckline: Sweetheart with beaded spaghetti straps Waist: Dropped Train: Court The combination of the intricately draped skirt and beaded detail on the bodice create a look that is dramatic and alluring. Fabric ruching to the low hip has a flattering effect on this gown. Two fabric flowers decorate the skirt for added interest. Shown with the Judith Simon crystal veil, and the MMM "Cassandra" hairpins - sold separately.|Stephen Yearick gowns are for the confident and glamorous bride. Known for his dramatics, Yearick uses exquisite beading with the most intricate detailing. Brides sparkle and shine on their wedding day in these modern designs.|Label Size: 12, Fits like an 8. Approximate Measurements: Bust 38", Waist 28", Hips 39"|2798|1'),
(511, 69, 1, 'Trumpet|Enabled|None|test product name|||testing||9.99|0'),
(524, 64, 1, 'Sweetheart|Not Strapless|Trumpet|14+|6''0&quot;+|New|Enabled|Taxable Goods|Pronovias "Ritmo", Casual Dress Size 12|Glamorous-Elegant|Romantic-Feminine|Flowing|Lightweight|Sheer|Structured|Pronovias|Full Bust|Hour Glass|Pear|||Color: Diamond White Collection Year: 2009 Fabric: Tulle Silhouette: Trumpet Neckline: V-Neck Waist: None Train: Chapel Condition: Has been EBI inspected and certified to be Pristine. Brand-NEW This stunning gown was designed from tulle and has lace and bead applique. Skirt is micro-pleated, and very full. Straps are wide in front and thin out in the back.|Considering themselves the world&rsquo;s leading bridal house, Pronovias is run by designer and director Manuel Mota of Spain. He and more than seventy others are on the cusp of the hottest and most unique trends, fabrics, styles, etc. Based in Spain, they are known for the lace gowns, and fitted designs.|Designer Size 14, Fits like a 12. No alterations done.|2000|1'),
(552, 68, 1, 'Sweetheart|Strapless|Trumpet|12|6''0&quot;+|New|Enabled|Taxable Goods|Tara Keely #2013, Casual Dress Size 12|Glamorous-Elegant|Modern-Chic|Lightweight|Sheer|Shiny|Tara Keely|Full Bust|Hour Glass|||Color: Ivory Fabric: 100% Silk Shantung and Tulle Silhouette: Trumpet Neckline: Strapless Sweetheart Waist: Natural Waist with Princess Seams and belt Train: Court Receipt Available: No This beautiful gown will give you a light and fun feel on your wedding day. With a bit of glam in the waistband, the tiered pleated tulle skirt makes a statement. Show off your curves in this fit and flare silhouette. Complete with a built in underskirt.|Tara Keely collections feature sweet and chic gowns with modern and fresh detailing. Refined and classic, Tara Keely uses high quality fabrics to match the perfect shape and feel. Understated embellishments make gowns special.|Label size 14, fits like a 12. Designer measurements: bust 39", waist 31", hips 41"|2100|1'),
(523, 65, 1, 'V-Neck|Not Strapless|Trumpet|12|5''11&quot;|New|Enabled|Taxable Goods|St. Pucchi Sposa Z-221, Casual Dress Size 10|Beach-Casual|Romantic-Feminine|Lightweight|Matte|Structured|St. Pucchi Spose|Full Bust|Hour Glass|Inverted Triangle|||Color: Ivory Fabric: Shantung Thai Silk Silhouette: Trumpet Neckline: V-neck Halter Waist: Natural The gown is the essence of St. Pucchi''s unique design aesthetic. This dress will show off that amazing figure and helps to hid the imperfections with the gathered waist line and placement of the flower appliques. Gracefully show off your back with the gorgeous low back cutout followed beautifully by fabric covered buttons. Includes a built in underskirt.|President and designer of St. Pucchi, Rani Totman, is known far and wide in the bridal industry for her avant-garde designs that stand out among the masses. St. Pucchi serves a very specific niche of brides that love a regal look. St. Pucchi gowns can be seen at the most lavish of weddings.|Label Size: 12; Fits like a 10. Approximate Measurements: bust 36"; waist 30"; hips 36". Looks best on someone 5''8" - 5''11".|2232|1'),
(521, 66, 1, 'Scoop|Strapless|Ball Gown|12|5''9&quot;|New|Enabled|Taxable Goods|Stephen Yearick #13228, Casual Dress Size 12|Classic-Traditional|Glamorous-Elegant|Romantic-Feminine|Heavier|Shiny|Structured|Stephen Yearick|Hour Glass|Inverted Triangle|Pear|Straight and Narrow|||Color: Ivory Fabric: 100% silk satin Silhouette: ball gown Neckline: Strapless Waist: Dropped Train: Chapel Receipt: yes A structured seamed bodice sits atop a voluminous pleated skirt on this regal gown while dazzling faceted crystals accent the dropped waist. A 10 point French bustle has been added.|Stephen Yearick gowns are for the confident and glamorous bride. Known for his dramatics, Yearick uses exquisite beading with the most intricate detailing. Brides sparkle and shine on their wedding day in these modern designs.|Casual Dress Size: 12 Approximate Measurements: bust 39", waist 30", hips 40"|3100|1'),
(531, 60, 1, 'One Shoulder|Not Strapless|Trumpet|2|6''0&quot;+|Nearly-New|Enabled|Taxable Goods|Vera Wang "Calla Lily", Casual Dress Size 2|Beach-Casual|Classic-Traditional|Modern-Chic|Romantic-Feminine|Lightweight|Sheer|Structured|Vera Wang|Hour Glass|Straight and Narrow|||Color: Ivory Fabric: 100% silk organdy lined with silk satin Silhouette: Trumpet Strapless: One shoulder Waist: None Train: Chapel Receipt Available: Yes From Vera Wang''s highly esteemed Luxe Collection comes this stunning gown designed from asymmetrically draped layers of silk organdy and finished with a detachable corsage that billows over the shoulder. Can be sold without the floral strap.|This former Vogue editor, turned high-end designer is now a household name. After over 20 years of opening her first salon doors, Vera Wang is loved now more than ever. Known for her amazing draping and use of different fabrics, Wang stays true to her original and confident designs. Vera Wang brides are modern and fashion forward.|Label Size: 4 Casual Dress Size: 2 Approximate Measurements: bust 33.5", waist 25", hips 36" Looks best on a taller bride 5''8" - 6''0|12850|1'),
(530, 61, 1, 'Straight|Strapless|A-Line|4|5''7&quot;|Nearly-New|Enabled|Taxable Goods|Vera Wang 12554, Casual Dress Size 4|Classic-Traditional|Heavier|Shiny|Structured|Vera Wang|Hour Glass|Inverted Triangle|Pear|Straight and Narrow|||Color: Light Ivory Fabric: Silk Satin Silhouette: Modified a-line Neckline: Strapless Waist: Empire with Princess Seams Train: Chapel You may have seen this elegant Vera Wang design before featured in the Estee Lauder advertisement and commercial. This sleek gorgeous gown is detailed with pearl beading along the empire waist on cross grain ribbon that ties along the back of the gown. Fabric covered buttons line the entire back starting at the top of the invisible zipper to the end of the train. Along with a built in underskirt, this gown also has two built in bustles, so you can take your pick between a French or American. Comes with a matching silk satin shawl. This gown is great for any venue and can be exquisitely accessorized.|This former Vogue editor, turned high-end designer is now a household name. After over 20 years of opening her first salon doors, Vera Wang is loved now more than ever. Known for her amazing draping and use of different fabrics, Wang stays true to her original and confident designs. Vera Wang brides tend to be fashion forward and modern.|Label Size: 8 Casual Dress Size: 4 Approximate Measurements: bust 34"; waist 26"; hips n/a|5790|1'),
(535, 57, 1, 'Sweetheart|Strapless|Trumpet|4|5''10&quot;|New|Enabled|Taxable Goods|Rivini Couture Wedding Dress, Casual Dress Size 4|Classic-Traditional|Glamorous-Elegant|Heavier|Shiny|Structured|Rivini|Hour Glass|||Color: Ivory Fabric: 100% Silk Satin Silhouette: Trumpet Neckline: Strapless Sweetheart Waist: Empire Train: Chapel Receipt: Yes Condition: Pristine; Never worn or altered. This regal gown features sleek and rich fabric and exquisite appliques on a trumpet silhouette. A gathered and embellished empire waist sweetheart bodice sits atop a clean and full skirt. Complete with fabric covered buttons, the back of this gown also features a pleated inset in the train to perfectly combine a traditional and modern feel.|Designer Rita Vinieris&rsquo;s understated elegance in her gowns has gone a long way in providing brides with chic and beautiful gowns. Enhanced with soft embellishments, each gown is made from the highest quality fabrics with top level craftsmanship. For the classic bride, Rivini gives luxury and refinement like no one else.|Designer Size: 4 Approximate Measurements: 34" bust, 26" waist, 37" hips|4345|1'),
(538, 54, 1, 'Straight|Strapless|Mermaid|4|5''7&quot;|Nearly-New|Enabled|Taxable Goods|Oscar de la Renta 12N30, Casual Dress Size 4|Modern-Chic|Heavier|Shiny|Structured|Oscar De La Renta|Full Bust|Hour Glass|||Color: Ivory Collection Year: Spring 2010 Silhouette: Mermaid Fabric: 100% Silk Satin Neckline: Strapless Waist: None Train: Court Receipt: Yes This unique Oscar de la Renta features architectural asymmetrical lines combined with soft ruching. With both a modern and traditional flare, this simplistic gown gives you the best of both worlds. A strapless draped bodice sits atop a slimming bodice that shows off a curvy silhouette. The unique asymmetrical seam detail on the front provides interest. The mermaid skirt flares at the knees to create volume. Add a mermaid petticoat for more flare if desired.|Multi-award winning, Oscar de la Renta, is one of the world’s leading fashion designers. Trained by Balenciaga and Lanvin’s Antonio Castillo, la Renta has been designing a ready to wear line for celebrities and a discriminating clientele since the 1960s. Oscar de la Renta’s bridal line launched in 2003 and is consistent with modern aesthetic.|Label Size: 8 Casual Dress Size: 4; approximate measurements- bust 34", waist 28", hips 36.5"|4085|1'),
(540, 53, 1, 'Scoop|Strapless|A-Line|4|5''9&quot;|Sample|Enabled|Taxable Goods|Monique Lhuillier Couture, Casual Dress Size 4 - Limited Edition|Romantic-Feminine|Vintage-Style|Lace|Lightweight|Shiny|Monique Lhuillier|Apple|Inverted Triangle|Pear|Straight and Narrow|||Color: Ivory with a blush undertone Silhouette: Empire Neckline: Strapless Scoop Waist: Empire Train: Chapel Receipt: No This Monique Lhuillier sample runway gown is one of a kind. Feel like a celebrity in a stylish gown that was just made for the runway. The Chantilly lace empire bodice sits on top a long skirt full of billowing pickups. Complete with a corset inside.|One of the industry’s hottest designers, Monique Lhuillier is known for her use of traditional fabrics and lace. A real romantic, Lhuillier is all about femininity and flattering a real women’s figure. After starting her business after her own wedding in 1995, Lhuillier’s success has flourished and her designs continue to be some of the most coveted.|Casual Dress Size: 4 Approximate Measurements: 34" bust, 26" waist, Hips n/a|4800|1');
