(542, 52, 1, 'Scoop|Strapless|A-Line|8|5''9&quot;|New|Enabled|Taxable Goods|Monique Lhuillier "Clementine" , Casual Dress Size 8|Classic-Traditional|Glamorous-Elegant|Romantic-Feminine|Flowing|Lightweight|Matte|Monique Lhuillier|Apple|Full Bust|Hour Glass|Inverted Triangle|Pear|Straight and Narrow|||Color: Ivory Silhouette: Aline Fabric: Silk faced Organza Neckline: Strapless Waist: Natural Train: Sweep This stunning gown features a heavily embellished floral motif bodice atop a buttery hand draped skirt. Accented with ribbons, hand beading, lace, and delicate embroidery, this gown has it all. Complete with a underskirt and functional fabric covered buttons.|One of the industry’s hottest designers, Monique Lhuillier is known for her use of traditional fabrics and lace. A real romantic, Lhuillier is all about femininity and flattering a real women’s figure. After starting her business after her own wedding in 1995, Lhuillier’s success has flourished and her designs continue to be some of the most coveted.|Label Size: 10 Casual Dress Size: 8 Approximate Measurements: 34D bust, 27" waist, hips n/a.|5200|1'),
(544, 51, 1, 'One Shoulder|Not Strapless|Mermaid|6|6''0&quot;+|Nearly-New|Enabled|Taxable Goods|Modern Trousseau "Tia", Casual Dress Size 6|Glamorous-Elegant|Modern-Chic|Flowing|Lightweight|Shiny|Modern Trousseau|Full Bust|Hour Glass|Straight and Narrow|||Color: Ivory Collection Year: Spring 2011 Fabric: Thai Silk Silhouette: Mermaid Neckline: One Shoulder Sweetheart Waist: Natural Train: Court Tia is perfect for the classic bride who wants a dress that is unique, refreshing, and fun. The one-shoulder neckline is accented with a hand-made organza flower. The rushed bodice and draped tiered marmaid skirt flatter almost any figure. The skirt is enhanced by a hand-made organza floral accent. Completed with covered rear buttons and an added French bustle.|Modern Trousseau designer Calle Tein designs every one of her gowns with a sophistication and a modern twist. All made in the USA, Modern Trousseau gowns include endless variations of colors, fabrics, and trims.|Casual Dress Size: 6 Approximate Measurements: 34C bust, 27" waist, 38" hips|3500|1'),
(548, 55, 1, 'Sweetheart|Not Strapless|Sheath|6|5''10&quot;|New|Enabled|Taxable Goods|Peter Langner "Xantia Due" , Casual Dress Size 6|Glamorous-Elegant|Romantic-Feminine|Vintage-Style|Flowing|Lightweight|Shiny|Peter Langner|Hour Glass|Petite|Straight and Narrow|||Color: Ivory Fabric: 100% silk crepe back satin and chiffon Silhouette: sheath Neckline: sweetheart with straps Waist: Empire Train: Chapel Receipt: no Float down the aisle in this magnificent gown by Peter Langner. The bodice of this gown has been altered from the original design to include a sweetheart ruched bodice, and 2" straps. Silk chiffon butterfly sleeves have been attached to the rear straps. The back of this gown has dramatic draping that gathers at the hips and then flows down to form the train. A bustle has not yet been added.|Peter Langner designs gowns with exquisite style and amazing quality. With technique learned in Paris, Langner has worked for high-end designers such as Christian Dior and Christian Laccroix. From his current studio in Paris, Langner designs architectural gowns that convey elegance.|Label Size: n/a - made to measure Casual Dress Size: 6 Approximate Measurements: bust 34", waist 28 1/2", hips 37"|7200|1');
