(50, 4, 129, 0, 4, 'Conditions content'),
(52, 4, 133, 0, 4, 'Return policy content'),
(53, 4, 134, 0, 4, 'Free guarantee content'),
(108, 4, 66, 0, 9, 'Color: Ivory \r\nFabric: Silk Organza \r\nSilhouette: Aline \r\nNeckline: Strapless \r\nWaist: Natural \r\nTrain: Chapel \r\nCollection: Fall 2009 \r\nReceipt: Yes \r\n\r\nFloat down the aisle in this light and simple gown by Augusta Jones. The aline organza skirt flows over a sheath underskirt. Ruching on the bodice provides interest and a flattering fit. The floral strap is unattached and can be easily stitched on in whichever way your heart desires (either shoulder or even as a belt). The sample of this gown is shows a lace skirt which has been eliminated from this custom design. Complete with an inner corset which helps to accentuate the waistline. \r\n\r\nShown with Galgallin rose quartz earrings and Lori London Light Ivory Chapel Veil - each sold separately'),
(109, 4, 67, 0, 9, 'Float down the aisle in this light and simple gown by Augusta Jones.'),
(111, 4, 129, 0, 9, 'Has been EBI inspected and certified to be in Pristine Condition; Brand-new with tags. '),
(113, 4, 133, 0, 9, 'Contact us within seven (7) days of receiving your item and inform us of your intention to return, or exchange.  You will then receive a response from us within 24 hours with a return authorization number.  If you do not receive a response from us within that time frame, your message was not received.\r\n\r\nAll sales are final following 7 days of receipt if a return authorization number has not been issued.\r\n\r\nOnce you receive a return tracking number, ship the item back to us (we do not pay for return shipping or insurance) ensuring that we receive the item within 7 days of receiving your authorization number.  If we do not receive the item within 7 days, it will be refused and shipped back to you at your cost without the refund. \r\n\r\nWedding Dresses:  If the item is returned in its original condition, without evidence of wear, staining, alterations or damage; we will reimburse you the original cost of the gown, minus your original shipping cost and a 5% restocking fee.'),
(114, 4, 134, 0, 9, 'We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dreses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.'),
(115, 4, 77, 0, 9, 'Discounted Augusta Jones, '),
(116, 4, 99, 0, 9, NULL),
(131, 4, 66, 0, 10, 'Color: Ivory \r\nFabric: Shell is 100% Silk Organza \r\nSilhouette: Ball Gown \r\nNeckline: Sweetheart Strapless \r\nWaist: Natural \r\nTrain: Chapel \r\nCollection: Fall 2011 \r\nOriginal Receipt: yes \r\n\r\nThis stunning gown by Lazaro features a full skirt decorated with silk organza petals that give it volume and texture. Just the right amount of large crystals accent the skirt while the jewel encrusted bodice sparkles. The sheer bodice was ordered lined (an extra charge of $175), but can easily be removed if the original look is preferred. A very special gown. \r\n\r\nShown here with a fingertip length one layer veil, Haute Bride Crystal Hair Pin H010, and Judd Waddell Mauve Satin Sash. All sold separately.'),
(132, 4, 67, 0, 10, 'This stunning gown by Lazaro features a full skirt decorated with silk organza petals that give it volume and texture'),
(134, 4, 129, 0, 10, 'Has been EBI inspected and certified to be in Pristine condition at time of posting.  Brand-new with tags.  '),
(136, 4, 133, 0, 10, 'Contact us within seven (7) days of receiving your item and inform us of your intention to return, or exchange.  You will then receive a response from us within 24 hours with a return authorization number.  If you do not receive a response from us within that time frame, your message was not received.\r\n\r\nAll sales are final following 7 days of receipt if a return authorization number has not been issued.\r\n\r\nOnce you receive a return tracking number, ship the item back to us (we do not pay for return shipping or insurance) ensuring that we receive the item within 7 days of receiving your authorization number.  If we do not receive the item within 7 days, it will be refused and shipped back to you at your cost without the refund. \r\n\r\nWedding Dresses:  If the item is returned in its original condition, without evidence of wear, staining, alterations or damage; we will reimburse you the original cost of the gown, minus your original shipping cost and a 5% restocking fee.'),
(137, 4, 134, 0, 10, 'We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dreses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.'),
(138, 4, 77, 0, 10, NULL),
(139, 4, 99, 0, 10, NULL),
(150, 4, 66, 0, 11, 'Color: Ivory\r\nCollection Year: Fall 2010\r\nSilhouette: Ball gown\r\nFabric: 100% silk taffeta and silk organza\r\nNeckline: Strapless sweetheart\r\nWaist: Dropped\r\nTrain: Court\r\nReceipt: Yes\r\n\r\nFrom Amsale Aberra''s Blue Label Collection comes "Bijou" a soft silk taffeta ball gown. "Bijou''s" flattering ruched bodice flows into a multidimensional full skirt adorned with hand-made taffeta and organza flowers. It is sure to surprise and delight your groom and guests. Only a select number of gowns are chosen each year for the Blue Label Collection. These gowns are more complex in their construction, requiring more involved work and higher utilization of finer fabrics. Each gown is created individually and carries a signature blue label with the AMSALE ABERRA logo. Our gown is complete with a bustle and a blue bow sewn in the interior bodice for your "something blue".'),
(151, 4, 67, 0, 11, NULL),
(152, 4, 148, 0, 11, 'Amsale designs are for the bride who wants a clean and modern aesthetic. Understated and classic, Ethiopian-born Amsale believes that every dress has a certain personality to match the right bride. With her clean and perfectly simple gown, Amsale is able to use many different fabrics, textures, and symmetry to enhance a specific bridal look. '),
(154, 4, 129, 0, 11, 'Condition: Excellent; Gently worn and cleaned by one of the top couture gown cleaners in the country. No readily observable imperfections. '),
(155, 4, 133, 0, 11, NULL),
(156, 4, 134, 0, 11, NULL),
(157, 4, 77, 0, 11, NULL),
(158, 4, 99, 0, 11, NULL),
(174, 4, 66, 0, 12, '<p>Add a touch of glamour to your look with this rhinestone beaded comb that has an antique gold finish.  Can be worn on top of your head as a small tiara or tucked in a back hair design.</p>\r\n<p>Width is 4" and height is 1". Adjustable 2.5" twisted metal comb.</p>'),
(175, 4, 148, 0, 12, NULL),
(177, 4, 129, 0, 12, 'Like-New'),
(178, 4, 133, 0, 12, 'Returns accepted for full refund minus shipping costs.  See Return Policy for more information - '),
(179, 4, 134, 0, 12, NULL),
(180, 4, 67, 0, 12, NULL),
(181, 4, 77, 0, 12, NULL),
(182, 4, 99, 0, 12, NULL),
(207, 4, 66, 0, 13, '<p>Be modernly romantic in this incredible Vera Wang design. Made from ruched tulle, this gown is unique and fresh while perfectly showing off that great figure. A flower or hair piece could be paired beautifully with this gown to match the organza rosettes filled with crystals clustered around one strap. The skirt is dripping with cascading pressed pleat tulle ruffles that ensure that you will stand out on your big day. Do not let this brilliant design get away!</p>'),
(208, 4, 148, 0, 13, '<p><strong>Vera Wang</strong> - This former Vogue editor, turned high-end designer is now a household name. After over 20 years of opening her first salon doors, Vera Wang is loved now more than ever. Known for her amazing draping and use of different fabrics, Wang stays true to her original and confident designs.</p>'),
(210, 4, 129, 0, 13, '<p>Has been EBI inspected and certified to be in Excellent condition at time of posting. Brand-new.  It has never been worn, but has been altered. Original receipt and certificate of authenticity is available upon request.</p>'),
(211, 4, 133, 0, 13, 'Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information. '),
(212, 4, 134, 0, 13, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(213, 4, 67, 0, 13, NULL),
(214, 4, 77, 0, 13, NULL),
(215, 4, 99, 0, 13, NULL),
(231, 4, 148, 0, 10, NULL),
(234, 4, 66, 0, 14, '<p>As seen on the cover of Brides Magazine! The sleek bodice is separated from the fanciful layered skirt by a beautiful silk ribbon to accentuate the waist. Ruffles give the back of this dress added dimension and flare. This dress has effortless style. The back adornment is not as visible from the front as it looks in the pictures -- shown this way as the zipper did not completely zip due to the large size of the dress form. Complete with a bustle.</p>'),
(235, 4, 148, 0, 14, '<p>Born and raised in Japan and now established in New York,, Junko Yoshioka has been designing since a young age. Recognized for her creative designs and versatile use of fabrics, Yoshioka has not only dressed countless brides, but also carries a long celebrity clientele. Hand made appliques as well as asymmetrical lines and varieties of textures can be seen in her designs.</p>'),
(237, 4, 129, 0, 14, 'Has been EBI inspected and certified to be in Very Good condition. Professionally cleaned. Tears around hem; can easily be hemmed off when altered.'),
(238, 4, 133, 0, 14, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
