(276, 4, 66, 0, 16, '<p>Float down the aisle in this light and simple gown by Augusta Jones. The aline organza skirt flows over a sheath underskirt. Ruching on the bodice provides interest and a flattering fit. The floral strap is unattached and can be easily stitched on in whichever way your heart desires (either shoulder or even as a belt). The sample of this gown shows a lace skirt which has been eliminated from this custom design. Complete with an inner corset which helps to accentuate the waistline.</p>'),
(277, 4, 148, 0, 16, '<p>Started in 1999 by Charlotte Leung, the Augusta Jones style is defined by contemporary clean lines with a twist - usually in the form of an unexpected bejeweled detail. Successful from the start, this young company has been awarded three British Bridal finalist awards within the first two years of introducing the label. Their work is regularly featured editorially in Cosmopolitan Bride, In-Style Wedding, Brides, Wedding &amp; Home, and You &amp; Your Wedding.</p>'),
