(316, 4, 66, 0, 18, '<p>This Alvina Valenta gown is an understated design with an organic look and feel. The silk fabric gives off a perfect sheen and gives this gown a divine illusion. Much detail of the gown is seen in the pleated bodice and ruched waist that is finished with a layered and raw edgedfl oral applique. The feminine skirt floats beautifully down to the floor.</p>'),
