(650, 4, 66, 0, 31, '<p>This beautifully unique design by Jim Hjelm is a show stopper hands down! With its gently draped bodice and organza overlay skirt, this gown is one that will float down the aisle with you. Great for an outdoor wedding, this gown has a one shoulder spaghetti strap that is detailed with organza floral appliques and a touch of rhinestones and crystals. Complete with a built in underskirt and bustle.</p>'),
(651, 4, 148, 0, 31, '<p>Designer of Jim Hjelm Bridal, California native, and Otis design school alumnis, Francesca Pitera was formally the senior designer for St. John. After finally following her passion for bridal, Pitera now designs innovative and fresh gowns in the most luxurious fabrics.</p>'),
(652, 4, 129, 0, 31, 'EBI inspected and certified to be in very good condition. Professionally cleaned and refreshed. Few barely noticeable marks. '),
(653, 4, 133, 0, 31, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(654, 4, 134, 0, 31, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(655, 4, 77, 0, 31, NULL),
(656, 4, 99, 0, 31, NULL),
(665, 4, 66, 0, 32, '<p>This 40''s inspired design would be great for an era themed wedding. With a sleek and chic feel, this silhouette with show off a svelte figure. This would be great paired with long draped pearls.</p>'),
(666, 4, 148, 0, 32, '<p>Designers Ivana Ristic and Lynn Rosenzweig are a wonderful team when creating Ristarose gowns. Romantic with a vintage twist, all Ristarose gown are made with beautiful fabrics and femininity of women in mind.</p>'),
(667, 4, 129, 0, 32, '<p>EBI inspected and certified to be in excellent condition.</p>'),
(668, 4, 133, 0, 32, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(669, 4, 134, 0, 32, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(670, 4, 77, 0, 32, NULL),
(671, 4, 99, 0, 32, NULL),
(678, 4, 66, 0, 33, '<p>A glamorous and fun gown by Somsi Couture, this 2 piece gown was designed from the softest silk organza and silk chiffon. On the top, layers of organza sit playfully above ruched chiffon. Silk netting and a flower crystal brooch accent the empire waist line. The tiered organza skirt beautifully fits through the hips and then flares. This gown is more than worthy of a walk down the red carpet....or white aisle. Photos of this dress on a bride can be viewed on our blog. </p>'),
(679, 4, 148, 0, 33, '<p>All Somsi Couture gowns are made in the USA and have hand-finished details worthy of a couture house. Born in Malaysia, Somsi&rsquo;s passion for fashion, love for beautiful things, and constant search and demand for uniqueness, has led her to designing collections of absolutely unique one-of-a-kind gowns for a fashion savvy bride.</p>'),
(680, 4, 129, 0, 33, '<p>EBI inspected and certified to be in excellent condition. Has been museum quality cleaned and walk down the aisle ready. A few very light marks remain near the hem of the train. See photos.</p>'),
(681, 4, 133, 0, 33, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(682, 4, 134, 0, 33, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(683, 4, 77, 0, 33, NULL),
(684, 4, 99, 0, 33, NULL),
(697, 4, 66, 0, 34, '<p>This ducchess satin gown is bias cut to beautifully drape as it does in the bustled skirt. Complete with pearl buttons lining the zipper, this wedding dress is glamorous and classy.</p>'),
(698, 4, 148, 0, 34, '<p>Built on the concept of luxury, Ulla Maija is wholeheartedly a couture bridal house. From Eastern France, designer Anna Maier knows the creativity, detail, and techniques it takes to produce a unique and quality gown. Beauty is found in every Maija design.</p>'),
(699, 4, 129, 0, 34, '<p>EBI inspected and certified to be in excellent condition. Small spot on front of the skirt. See photo. Back of gown is not shown completely zipped due to the large size of the mannequin.</p>'),
(700, 4, 133, 0, 34, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(701, 4, 134, 0, 34, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(702, 4, 77, 0, 34, NULL),
(703, 4, 99, 0, 34, NULL),
(710, 4, 66, 0, 35, '<p>Kristen features an asymmetrical pleated bodice atop a trumpet skirt. The bodice has the perfect touch of hand placed Alencon lace. The back of the gown "wow" with a unique pleated skirt and train, low back, and fabric covered buttons.</p>'),
(711, 4, 148, 0, 35, '<p>Designer Elena Ham, of Va Lena Valentina, is a European San Diego based designer. Inspired by her mother and strong femininity, Elena believes in every woman feeling like a queen on her wedding day. Her designs feature distinct details and alluring lines all to accent a classic look and a woman''s natural beauty.</p>'),
(712, 4, 129, 0, 35, '<p>EBI Inspected and certified to be in excellent condition. Has been taken-in slightly in the bodice, but never worn. There are a couple of very faint reddish marks on the rear skirt - barely noticeable. See photos.</p>'),
(713, 4, 133, 0, 35, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>');
INSERT INTO `catalog_product_entity_text` (`value_id`, `entity_type_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(714, 4, 134, 0, 35, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(715, 4, 77, 0, 35, NULL),
(716, 4, 99, 0, 35, NULL),
(725, 4, 66, 0, 36, '<p>From Amsale Aberra''s Blue Label Collection comes "Bijou" a soft silk taffeta ball gown. "Bijou''s" flattering ruched bodice flows into a multidimensional full skirt adorned with hand-made taffeta and organza flowers. It is sure to surprise and delight your groom and guests.</p>'),
(726, 4, 148, 0, 36, '<p>Amsale designs are for the bride who wants a clean and modern aesthetic. Understated and classic, Ethiopian-born Amsale believes that every dress has a certain personality to match the right bride. With her clean and perfectly simple gown, Amsale is able to use many different fabrics, textures, and symmetry to enhance a specific bridal look.</p>\r\n<p>Only a select number of gowns are chosen each year for the Blue Label Collection. These gowns are more complex in their construction, requiring more involved work and higher utilization of finer fabrics. Each gown is created individually and carries a signature blue label with the AMSALE ABERRA logo. Our gown is complete with a bustle and a blue bow sewn in the interior bodice for your "something blue".</p>'),
(727, 4, 129, 0, 36, '<p>EBI inspected and certified to be in excellent condition. Cleaned by one of the top couture gown cleaners in the country. No readily observable imperfections. Some of the added fabric on the skirt may require minor re-tacking.</p>'),
(728, 4, 133, 0, 36, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(729, 4, 134, 0, 36, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(730, 4, 77, 0, 36, NULL),
(731, 4, 99, 0, 36, NULL),
(738, 4, 66, 0, 37, '<p>This sweet and youthful Carolina Herrera gown features a strapless bodice enhanced by ruffles sitting perfectly atop a light and floating pleated aline skirt. Separated by a gathered sash at the natural waist, this silhouette and silk polka dot jacquard are both comfortable and whimsical.</p>'),
(739, 4, 148, 0, 37, '<p>Carolina Herrera became a household name after designing a wedding dress for Caroline Kennedy.  Her gowns are both decidedly simplistic and works for art.  She often surprises with  rich and interesting fabrics, painted detailing, lace appliques and jacquard patters.  Her designs depict elegance and intricacy without losing the appearance of simplicity.</p>'),
(740, 4, 129, 0, 37, '<p>EBI inspected and certified to be in very good condition. Professionally cleaned, but some marks still remain. Minor fabric imperfections on the train. See pictures.</p>'),
(741, 4, 133, 0, 37, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
