(743, 4, 77, 0, 37, NULL),
(744, 4, 99, 0, 37, NULL),
(751, 4, 66, 0, 38, '<p>This elegant gown has a very organic and fresh look and feel from the rouched bodice to Shantung fabric. With the flattering silhouette a custom added floral appliques accent one hip. Great for an indoor or outdoor wedding, you can accessorize this gown to fit almost any feel.</p>'),
(752, 4, 148, 0, 38, '<p>Christos was established over 20 years ago by Christos Yiannakou and is currently under creative direction the ever-popular bridal designer Amsale Aberra (see AMSALE).  Christos gowns evoke a feeling of fairy-tale, femininity, and romance.  The finest silk fabrics and French laces are the staples of the collection.</p>'),
(753, 4, 129, 0, 38, '<p>EBI inspected or certified to be in excellent condition. Professionally cleaned and refreshed with no notable imperfections.</p>'),
(754, 4, 133, 0, 38, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(755, 4, 134, 0, 38, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(756, 4, 77, 0, 38, NULL),
(757, 4, 99, 0, 38, NULL),
(764, 4, 66, 0, 39, '<p>Sophisticated and traditional, this gown features a flattering portrait neckline and off the shoulder sleeves atop a trumpet skirt. Princess lines, luxurious fabric, and an embellished empire waist give this gown both a regal feel and touch.</p>'),
(765, 4, 148, 0, 39, '<p>Christos was established over 20 years ago by Christos Yiannakou and is currently under creative direction the ever-popular bridal designer Amsale Aberra (see AMSALE).  Christos gowns evoke a feeling of fairy-tale, femininity, and romance.  The finest silk fabrics and French laces are the staples of the collection.</p>'),
(766, 4, 129, 0, 39, '<p>EBI inspected and certified to be in very good condition. Professionally cleaned. Has a few snags in the fabric, including one on the front bodice and one on the front skirt; only notable when looking for them. There are also several very light marks on the train - one the size of a quarter and other smaller ones. Marks along 1" of front hem. See photos.</p>'),
(767, 4, 133, 0, 39, 'Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.'),
(768, 4, 134, 0, 39, 'We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.'),
(769, 4, 77, 0, 39, NULL),
(770, 4, 99, 0, 39, NULL),
(779, 4, 66, 0, 40, '<p>Sold exclusively at the high fashion e-Boutique, Net-A-Porter, this maxi skirt and wrap effect top by Donna Karan have a modern minimalist look. The bias cut skirt has angled seams and rear zipper while the draped top has a modified racer back to show off your beautiful shoulders. A sophisticated gown perfect for a contemporary city bride.</p>\r\n<p>Alterations made: none to the body or length. A small invisible stitch was made to the inside of the top to stop unwanted show.</p>'),
(780, 4, 148, 0, 40, '<p>Donna Karen, high end designer in the fashion industry, brings her high standard of quality and amazing designing into the bridal market to produce exquisite gowns for the classy woman. Rich fabrics and precise cuts can be seen in all the exclusive gowns.</p>'),
(781, 4, 129, 0, 40, '<p>EBI inspected and certified to be very good condition. Has been cleaned. Has a couple of very light marks (hardly noticeable) on back of the top and a couple of more notable spots on the hem of the train. See photos.</p>'),
(782, 4, 133, 0, 40, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
