(784, 4, 77, 0, 40, NULL),
(785, 4, 99, 0, 40, NULL),
(796, 4, 66, 0, 41, '<p>This Douglas Hannant design is made from the finest silk and creates gorgeous dimension with the pin tuck pleats. This pleats release right at the hip to create a nice full skirt. The corset strapless bust shows off that gorgeous neckline. The dress is a classic and clean and can be worn with versatile jewelry and head pieces. Receipt available upon request.</p>'),
(797, 4, 148, 0, 41, '<p>Born and raised in the Midwest United States, Douglas Hannant worked his way up from the sales floor at Barneys to the Bryant Park runway. Inspired first by an old stockroom mannequin, Hannant has developed in to a high-end bridal designer with clientele around the world. Clean in construction, a urban and chic flare is seen in every one of his designs.</p>'),
(798, 4, 129, 0, 41, '<p>EBI inspected and certified to be in pristine condition.</p>'),
(799, 4, 133, 0, 41, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(800, 4, 134, 0, 41, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(801, 4, 77, 0, 41, NULL),
(802, 4, 99, 0, 41, NULL),
(811, 4, 66, 0, 42, '<p>This brand new Jim Hjelm design is romantic with a touch of glamor. Covered with a lace overlay, this gown is also adorned with beading and crystals along the empire waist and straps that all lead to a sexy low v-back. This gown is fully lined with a built in bustle. Great for any type of venue and can easily be worn with or without a veil.</p>'),
(812, 4, 148, 0, 42, '<p>Designer of Jim Hjelm Bridal, California native, and Otis design school alumnis, Francesca Pitera was formally the senior designer for St. John. After finally following her passion for bridal, Pitera now designs innovative and fresh gowns in the most luxurious fabrics.</p>'),
(813, 4, 129, 0, 42, '<p>EBI inspected and certified to be in pristine condition. All tags still attached. Has been altered.</p>'),
(814, 4, 133, 0, 42, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(815, 4, 134, 0, 42, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(816, 4, 77, 0, 42, NULL),
(817, 4, 99, 0, 42, NULL),
(826, 4, 66, 0, 43, '<p>This custom designed gown based of Jin Wang''s Eva II design features an architectural bodice atop a draped and voluminous skirt. The unconventional contrast makes for a unique and regal look. The alluring and rich fabric gives off the perfect amount of shine and the back of this gown will leave a lasting impression. Finished with an invisible rear zipper and added bustle.</p>'),
(827, 4, 148, 0, 43, '<p>Designer Jin Wang, designs her gowns in remembrance to Old World ateliers. Sewing from a young age, Wang has perfected her craft and is passionate about elegance and enhancing a bride''s beauty with her gowns. Graceful and timeless are two words easily conveying her designs.</p>'),
(828, 4, 129, 0, 43, '<p>EBI inspected and certified to be in very good condition. Faint marks on the train. Very tiny imperfections of fabric on the bust. See pictures.</p>'),
(829, 4, 133, 0, 43, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(830, 4, 134, 0, 43, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(831, 4, 77, 0, 43, NULL),
(832, 4, 99, 0, 43, NULL),
(841, 4, 66, 0, 44, '<p>A full lined petticoat, 2 layers of organza, and 2 layers of netting are the foundational elements of this romantic gown. Alencon lace flows from the bodice down through the skirt An art-deco style beaded "belt" accents the natural waist. This dress is dreamy, light, and flowing.</p>'),
(842, 4, 148, 0, 44, '<p>Judd Waddell&rsquo;s background in architecture is shown directly in his clean and simple designs. Classic and elegant, Waddell&rsquo;s stands firm in his design philosophy that states &ldquo;notice the woman first, the dress second.&rdquo;</p>'),
(843, 4, 129, 0, 44, '<p>Has been EBI inspected and certified to be in Excellent condition; Unworn Sample. Has been fully cleaned and repaired. No notable imperfections. Ready to walk down the aisle.</p>'),
(844, 4, 133, 0, 44, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(845, 4, 134, 0, 44, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(846, 4, 77, 0, 44, NULL),
(847, 4, 99, 0, 44, NULL),
(856, 4, 66, 0, 45, '<p>The elongated ruched bodice caresses the figure while the intricately beaded floral chiffon "belt" accents the natural waist on this Lazaro design. A pleated circular skirt adds drama. The finishing details include a crystal and petal accent on one shoulder and rear covered buttons.</p>'),
(857, 4, 148, 0, 45, '<p>Cuba native Lazaro Perez is the very talented and creative designer for both Lazaro and Tara Keely bridal lines. Well known for his exquisite embroidery and hand beading, Lazaro loves the drama and big shapes that a wedding gown can have. Loving what he does, Lazaro can&rsquo;t see himself doing anything else but creating beauty.</p>'),
(858, 4, 129, 0, 45, '<p>Has been EBI inspected and certified to be in Pristine condition; brand-new with tags.</p>'),
(859, 4, 133, 0, 45, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(860, 4, 134, 0, 45, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(861, 4, 77, 0, 45, NULL),
(862, 4, 99, 0, 45, NULL),
(871, 4, 66, 0, 46, '<p>Understated, yet alluring, this Italian silk satin gown features a hand-draped bodice sitting atop a slightly aline skirt. Finished with an invisible rear zipper and added bustle. This timeless gown is a blank canvas to create your unique look.</p>'),
(872, 4, 148, 0, 46, '<p>Made up of two international designers, Patricia Nevil and Corina Lewinzon, L&rsquo;ezu prides themselves on knowing what silhouette fits each body type. With a market towards sophisticated brides, may designs stem from the silhouettes of the 18th and 19th century with a modern flare. Education across the world, the L&rsquo;ezu designers like to make sure that every construction is like that of the classic couture houses.</p>'),
(873, 4, 129, 0, 46, '<p>EBI inspected and certified to be in pristine condition. Has been altered.</p>'),
(874, 4, 133, 0, 46, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(875, 4, 134, 0, 46, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(876, 4, 77, 0, 46, NULL),
(877, 4, 99, 0, 46, NULL),
(886, 4, 66, 0, 47, '<p>You will feel oh so elegant in this rich Lazaro design. The champagne color and asymmetrical ruched bodice give this gown a beautiful antique feel. Sexy, but still sophisticated, this strapless silk gown has a pearl and Swarovski crystal applique accenting the waist. Great dress for showing off a curvy figure, this gown will make you feel like royalty on your wedding day. Complete with a built in underskirt and bustle.</p>'),
(887, 4, 148, 0, 47, '<p>Cuba native Lazaro Perez is the very talented and creative designer for both Lazaro and Tara Keely bridal lines. Well known for his exquisite embroidery and hand beading, Lazaro loves the drama and big shapes that a wedding gown can have. Loving what he does, Lazaro can&rsquo;t see himself doing anything else but creating beauty.</p>'),
(888, 4, 129, 0, 47, '<p>EBI inspected and certified to be in excellent condition. Professionally cleaned; small unnoticeable imperfections in the fabric. Bustle needs simple re-attaching.</p>'),
