(903, 4, 66, 0, 48, '<p>This sleek and ethereal Lazaro design is one that will stand the test of time. The elongated torso enhanced with a gorgeous belt at the natural waist, will do wonders to your figure as the box pleated skirt gently flares to the floor. The scoop neck shows frames the bust while the back of the gown is complete with fabric covered buttons and a fluid train.</p>'),
