(918, 4, 66, 0, 49, '<p>Just like the princess, Lily Samii''s Grace, has a luxurious sensibility. Designed from the softest and lustrous silk ducchess, this gown is fully lined and impeccably constructed. Keep your look simple and classic or pair with bold accessories.</p>'),
(919, 4, 148, 0, 49, '<p>San Francisco based designer Lily Samii, uses her knowledge of French craftsmanship and years of experience to create high-end designer gowns that cater to the brides today. With extraordinary fabrics, Samii creates gown that are classic and comfortable.</p>'),
