(933, 4, 66, 0, 50, 'Color: Ivory <br><br>  \r\n\r\nFabric: Silk Taffeta <br><br> \r\n\r\nSilhouette: Trumpet <br><br> \r\n\r\nNeckline: Strapless <br><br> \r\n\r\nWaist: Dropped <br><br> \r\n\r\nTrain: Chapel <br><br> \r\n\r\nThis sweet and romantic gown is both timeless and flattering! With a softly ruched bodice and dropped asymmetrical waistline, this dress is perfect for showing of your curves. The draped skirt floats behind you and is enhanced by a hand crafted floral applique. This gown will look as if it were made just for you. Add fabric covered buttons or perfect as is.'),
(934, 4, 148, 0, 50, 'Melissa Sweet and Reverie by Melissa Sweet are part of the Priscilla Boston bridal house. This dress collection, like the name, is assuredly "sweet" with whimsical details.  The Melissa Sweet bride is fashion forward, feminine, and flirtatious.  As the Priscilla of Boston bridal house closed in late 2011, this is your last chance to be a Melissa Sweet bride. \r\n'),
