(938, 4, 77, 0, 50, NULL),
(939, 4, 99, 0, 50, NULL),
(948, 4, 66, 0, 51, 'Color: Ivory\r\n\r\nCollection Year: Spring 2011 <br><br> \r\n\r\nFabric: Thai Silk <br><br> \r\n\r\nSilhouette: Mermaid <br><br> \r\n\r\nNeckline: One Shoulder Sweetheart <br><br> \r\n\r\nWaist: Natural <br><br> \r\n\r\nTrain: Court <br><br>\r\n\r\nTia is perfect for the classic bride who wants a dress that is unique, refreshing, and fun.  The one-shoulder neckline is accented with a hand-made organza flower.  The rushed bodice and draped tiered marmaid skirt flatter almost any figure.  The skirt is enhanced by a hand-made organza floral accent.  Completed with covered rear buttons and an added French bustle.'),
(949, 4, 148, 0, 51, '<p>Modern Trousseau designer Calle Tein designs every one of her gowns with a sophistication and a modern twist.  All made in the USA, Modern Trousseau gowns include endless variations of colors, fabrics, and trims.</p>'),
(950, 4, 129, 0, 51, '<p>EBI inspected and certified to be excellent condition. Professionally cleaned; barely noticeable marks at hem remained after cleaning.  Some light marks around the buttons in the rear from being tried on since - recommend spot cleaning.</p>'),
