(963, 4, 66, 0, 52, 'Color: Ivory <br><br> \r\n\r\nSilhouette: Aline <br><br> \r\n\r\nFabric: Silk faced Organza <br><br> \r\n\r\nNeckline: Strapless <br><br> \r\n\r\nWaist: Natural <br><br> \r\n\r\nTrain: Sweep <br><br> \r\n\r\nThis stunning gown features a heavily embellished floral motif bodice atop a buttery hand draped skirt. Accented with ribbons, hand beading, lace, and delicate embroidery, this gown has it all. Complete with a underskirt and functional fabric covered buttons.'),
(964, 4, 148, 0, 52, 'One of the industry’s hottest designers, Monique Lhuillier is known for her use of traditional fabrics and lace. A real romantic, Lhuillier is all about femininity and flattering a real women’s figure. After starting her business after her own wedding in 1995, Lhuillier’s success has flourished and her designs continue to be some of the most coveted. '),
(965, 4, 129, 0, 52, '<p>EBI inspected and certified to be in pristine condition.  Brand-new, never worn, but altered.</p>'),
