(978, 4, 66, 0, 53, 'Color: Ivory with a blush undertone <br><br> \r\n\r\nSilhouette: Empire <br><br> \r\n\r\nNeckline: Strapless Scoop <br><br> \r\n\r\nWaist: Empire <br><br> \r\n\r\nTrain: Chapel <br><br> \r\n\r\nReceipt: No <br><br> \r\n\r\nThis Monique Lhuillier sample runway gown is one of a kind.  Feel like a celebrity in a stylish gown that was just made for the runway. The Chantilly lace empire bodice sits on top a long skirt full of billowing pickups. Complete with a corset inside.\r\n'),
(979, 4, 148, 0, 53, 'One of the industry’s hottest designers, Monique Lhuillier is known for her use of traditional fabrics and lace. A real romantic, Lhuillier is all about femininity and flattering a real women’s figure. After starting her business after her own wedding in 1995, Lhuillier’s success has flourished and her designs continue to be some of the most coveted. '),
(980, 4, 129, 0, 53, '<p>EBI inspected and certified to be in very good condition. Barely tried on so would not recommend cleaning. Small fabric imperfections at princess seams (from being pinned) that would be removed if altered smaller or can be covered with a sash.</p>'),
