(983, 4, 77, 0, 53, NULL),
(984, 4, 99, 0, 53, NULL),
(997, 4, 66, 0, 54, 'Color: Ivory <br><br> \r\n\r\nCollection Year: Spring 2010 <br><br> \r\n\r\nSilhouette: Mermaid <br><br> \r\n\r\nFabric: 100% Silk Satin <br><br> \r\n\r\nNeckline: Strapless <br><br> \r\n\r\nWaist: None <br><br> \r\n\r\nTrain: Court <br><br> \r\n\r\nReceipt: Yes <br><br> \r\n\r\nThis unique Oscar de la Renta features architectural asymmetrical lines combined with soft ruching. With both a modern and traditional flare, this simplistic gown gives you the best of both worlds. A strapless draped bodice sits atop a slimming bodice that shows off a curvy silhouette. The unique asymmetrical seam detail on the front provides interest.  The mermaid skirt flares at the knees to create volume.  Add a mermaid petticoat for more flare if desired. <br><br> \r\n'),
(998, 4, 148, 0, 54, 'Multi-award winning, Oscar de la Renta, is one of the world’s leading fashion designers.  Trained by Balenciaga and Lanvin’s Antonio Castillo, la Renta has been designing a ready to wear line for celebrities and a discriminating clientele since the 1960s.  Oscar de la Renta’s bridal line launched in 2003 and is consistent with modern aesthetic. '),
(999, 4, 129, 0, 54, '<p>EBI inspected and certified to be in excellent condition. Gently worn. No notable imperfections.</p>'),
