(1002, 4, 77, 0, 54, NULL),
(1003, 4, 99, 0, 54, NULL),
(1012, 4, 66, 0, 55, 'Color: Ivory <br> <br>\r\n\r\nFabric: 100% silk crepe back satin and chiffon <br> <br>\r\n\r\nSilhouette: sheath <br> <br>\r\n\r\nNeckline: sweetheart with straps <br> <br>\r\n\r\nWaist: Empire <br> <br>\r\n\r\nTrain: Chapel <br> <br>\r\n\r\nReceipt: no <br> <br>\r\n\r\nFloat down the aisle in this magnificent gown by Peter Langner.  The bodice of this gown has been altered from the original design to include a sweetheart ruched bodice, and 2" straps.  Silk chiffon butterfly sleeves have been attached to the rear straps.  The back of this gown has dramatic draping that gathers at the hips and then flows down to form the train.  A bustle has not yet been added.'),
(1013, 4, 148, 0, 55, '<p> Peter Langner designs gowns with exquisite style and amazing quality. With technique learned in Paris, Langner has worked for high-end designers such as Christian Dior and Christian Laccroix. From his current studio in Paris, Langner designs architectural gowns that convey elegance.</p>'),
(1014, 4, 129, 0, 55, '<p>EBI inspected and certified to be in excellent condition. Brand-new, never worn.  There are a couple of minor snags in the fabric and an approx 1" faint line mark on the back drape (see photo).</p>'),
