(1017, 4, 77, 0, 55, NULL),
(1018, 4, 99, 0, 55, NULL),
(1031, 4, 66, 0, 56, 'Color:  Ivory <br> <br>\r\n\r\nHollow to Hem: 38"<br><br>\r\n\r\nColor: Diamond white <br> <br>\r\n\r\nRistarose Raquel is perfect for your destination wedding, a beach wedding, or even your rehearsal dinner.  Beautiful silk chiffon is the foundation for this knee-length dress that has a sweetheart neckline and empire waist.  Thin straps criss-cross the low back that ends in covered buttons.  Fabric gathering around the buttons and scattered bugle beads add a feminine touch.    <br> <br> \r\n'),
(1032, 4, 148, 0, 56, '<p>Designers Ivana Ristic and Lynn Rosenzweig created Ristarose gowns for the romantic and chic bride.   All of their designs are made with top grade silk fabrics and with highest quality craftsmanship including silk linings.</p>'),
(1033, 4, 129, 0, 56, '<p>EBI inspected and certified to be in excellent condition. There is a very small hole in the back skirt shown in the picture.</p>'),
