(1036, 4, 77, 0, 56, NULL),
(1037, 4, 99, 0, 56, NULL),
(1046, 4, 66, 0, 57, 'Color: Ivory <br><br> \r\n\r\nFabric:  100% Silk Satin <br><br> \r\n\r\nSilhouette: Trumpet <br><br>\r\n\r\nNeckline: Strapless Sweetheart <br><br> \r\n\r\nWaist: Empire <br><br> \r\n\r\nTrain: Chapel <br><br> \r\n\r\nReceipt: Yes <br><br> \r\n\r\nCondition: Pristine; Never worn or altered. <br><br>\r\n\r\nThis regal gown features sleek and rich fabric and exquisite appliques on a trumpet silhouette. A gathered and embellished empire waist sweetheart bodice sits atop a clean and full skirt. Complete with fabric covered buttons, the back of this gown also features a pleated inset in the train to perfectly combine a traditional and modern feel.'),
(1047, 4, 148, 0, 57, '<p>Designer Rita Vinieris&rsquo;s understated elegance in her gowns has gone a long way in providing brides with chic and beautiful gowns. Enhanced with soft embellishments, each gown is made from the highest quality fabrics with top level craftsmanship. For the classic bride, Rivini gives luxury and refinement like no one else.</p>'),
