(1051, 4, 77, 0, 57, NULL),
(1052, 4, 99, 0, 57, NULL),
(1061, 4, 66, 0, 58, 'Color: Ivory <br><br> \r\n\r\nSilhouette: Ball Gown <br><br> \r\n\r\nFabric: Thai silk taffeta<br><br> \r\n\r\nNeckline: Strapless Scoop <br><br> \r\n\r\nWaist: Dropped Waist <br><br> \r\n\r\nTrain: Cathedral <br><br> \r\n\r\nFrom its exquisite embroidery to perfectly placed rosettes, this St. Pucchi design is a true work of art.   A heavily embellished scoop neckline dramatically falls into a dropped waist and draped voluminous skirt. Dripping with detail, this gown is quite certain to keep everyone talking.  Complete with a bustle.<br><br> \r\n '),
(1062, 4, 148, 0, 58, '<p>President and designer of St. Pucchi, Rani Totman is known far and wide for her avant-garde designs that stand out among the masses St. Pucchi serves a very specific niche of brides. Regal in look and luxurious in texture, St. Pucchi gowns can be seen at the most lavish of weddings.</p>'),
