(1066, 4, 77, 0, 58, NULL),
(1067, 4, 99, 0, 58, NULL),
(1088, 4, 66, 0, 59, 'Color: Blush <br><br> \r\n\r\nFabric: Thai Silk Taffeta <br><br>\r\n\r\nSilhouette: Ball Gown <br><br> \r\n\r\nNeckline: Strapless <br><br> \r\n\r\nWaist: Dropped <br><br> \r\n\r\nTrain: Cathedral <br><br> \r\n\r\nThe time period looking design by St. Pucchi features a corset bodice with noticeable boning and a lace up back. Small ruffles peak out of the strapless top of this gown and functional metal hooks act as an additional closure down the front. Complete with a built in petticoat, the full skirt is gathered at the dropped waist and finished with a bubble hem. The built in bustle creates more beautiful volume. For brides who want a unique wedding dress, this is for you!<br><br> \r\n'),
