INSERT INTO `catalog_product_entity_text` (`value_id`, `entity_type_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(1093, 4, 77, 0, 59, NULL),
(1094, 4, 99, 0, 59, NULL),
(1103, 4, 66, 0, 60, 'Color: Ivory <br><br>\r\n\r\nFabric: 100% silk organdy lined with silk satin <br><br> \r\n\r\nSilhouette: Trumpet <br><br> \r\n\r\nStrapless: One shoulder <br><br> \r\n\r\nWaist: None <br><br> \r\n\r\nTrain: Chapel <br><br> \r\n\r\nReceipt Available: Yes <br><br> \r\n\r\nFrom Vera Wang''s highly esteemed Luxe Collection comes this stunning gown designed from asymmetrically draped layers of silk organdy and finished with a detachable corsage that billows over the shoulder.  Can be sold without the floral strap.  <br><br> \r\n'),
(1104, 4, 148, 0, 60, '<p>This former Vogue editor, turned high-end designer is now a household name. After over 20 years of opening her first salon doors, Vera Wang is loved now more than ever. Known for her amazing draping and use of different fabrics, Wang stays true to her original and confident designs.  Vera Wang brides are modern and fashion forward.</p>'),
(1105, 4, 129, 0, 60, '<p>EBI inspected and certified to be in excellent condition. Professionally cleaned and refreshed. There is one small spot and some slight fraying of the fabric on the very end of the train.</p>'),
(1106, 4, 133, 0, 60, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(1107, 4, 134, 0, 60, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(1108, 4, 77, 0, 60, NULL),
(1109, 4, 99, 0, 60, NULL),
(1118, 4, 66, 0, 61, 'Color: Light Ivory <br><br> \r\n\r\nFabric: Silk Satin <br><br>\r\n\r\nSilhouette: Modified a-line <br><br> \r\n\r\nNeckline: Strapless <br><br> \r\n\r\nWaist: Empire with Princess Seams <br><br> \r\n\r\nTrain: Chapel <br><br> \r\n\r\nYou may have seen this elegant Vera Wang design before featured in the Estee Lauder advertisement and commercial. This sleek gorgeous gown is detailed with pearl beading along the empire waist on cross grain ribbon that ties along the back of the gown. Fabric covered buttons line the entire back starting at the top of the invisible zipper to the end of the train. Along with a built in underskirt, this gown also has two built in bustles, so you can take your pick between a French or American. Comes with a matching silk satin shawl.  This gown is great for any venue and can be exquisitely accessorized. <br><br>\r\n\r\n'),
(1119, 4, 148, 0, 61, '<p>This former Vogue editor, turned high-end designer is now a household name. After over 20 years of opening her first salon doors, Vera Wang is loved now more than ever. Known for her amazing draping and use of different fabrics, Wang stays true to her original and confident designs.  Vera Wang brides tend to be fashion forward and modern.  </p>'),
(1120, 4, 129, 0, 61, '<p>EBI inspected and certified to be in Very Good condition. Completely cleaned and refreshed. The fabric is not as "crisp" as a new gown.   Original receipt available for proof of authenticity and can be shipped with the gown.</p>'),
(1121, 4, 133, 0, 61, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(1122, 4, 134, 0, 61, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(1123, 4, 77, 0, 61, NULL),
(1124, 4, 99, 0, 61, NULL),
(1131, 4, 66, 0, 62, 'Color: Light Ivory <br><br> \r\n\r\nCollection Year: 2009 <br><br> \r\n\r\nFabric: Organza <br><br> \r\n \r\nSilhouette: Modified Aline <br><br> \r\n\r\nNeckline: Strapless Sweetheart <br><br> \r\n\r\nWaist: Natural <br><br>\r\n\r\nTrain: Chapel <br><br>\r\n\r\nThis gown will make you feel like a goddess with its draped bust and layered cascading skirt. The light fabric beautifully flows while the waist beading and appliques helps to show off your figure. Completely lined with a built in underskirt.  <br><br>'),
(1132, 4, 148, 0, 62, '<p>Designed by American designer Tamara Kristen, Marisa gowns are classic and proven to be popular styles.  All gowns are made from silk with reasonable price points. </p>'),
(1133, 4, 129, 0, 62, '<p>EBI inspected and certified to be in very good condition. Professionally cleaned. Few barely visible imperfections in fabric; can be hemmed off.</p>'),
(1134, 4, 133, 0, 62, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
(1135, 4, 134, 0, 62, '<p>We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dresses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>'),
(1136, 4, 77, 0, 62, NULL),
(1137, 4, 99, 0, 62, NULL),
(1150, 4, 66, 0, 63, 'Color: Ivory <br><br> \r\n\r\nFabric: Silk Satin faced Chiffon <br><br> \r\n\r\nSilhouette: Slim Aline <br><br> \r\n\r\nNeckline: Strapless Scoop <br><br> \r\n\r\nWaist: Empire <br><br> \r\n\r\nTrain: Chapel <br><br> \r\n\r\nThis ethereal Priscilla of Boston gown fully encompasses a fanciful and sophisticated look. The perfect draped bust sits a top an elaborately beaded waist. A fluid and sleek skirt cascades beautifully, slightly grazing the floor. Both dreamy and elegant, this gown is a show stopper.'),
(1151, 4, 148, 0, 63, '<p>Priscilla of Boston was one of the oldest and most established bridal houses in the United States for decades.   Priscilla Kidder, the original designer, opened her store on Newbury street in 1945 and designed dresses for many well-known brides.  Each gown was designed using couture craftsmanship, modern silhouettes, and unique details to create a classic and timeless style.  This is your last chance to wear a Priscilla of Boston gown as they closed their doors in late 2011.</p>'),
(1152, 4, 129, 0, 63, '<p>EBI inspected and certified to be excellent condition.  Sample gown, never worn.  Ready to walk down the aisle.</p>'),
(1153, 4, 133, 0, 63, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
