(1155, 4, 77, 0, 63, NULL),
(1156, 4, 99, 0, 63, NULL),
(1165, 4, 66, 0, 64, 'Color: Diamond White<br><br>\r\n\r\nCollection Year:  2009 <br> <br>\r\n\r\nFabric: Tulle<br><br>\r\n\r\nSilhouette: Trumpet<br><br>\r\n\r\nNeckline: V-Neck<br><br>\r\n\r\nWaist: None<br><br>\r\n\r\nTrain: Chapel<br><br>\r\n\r\nCondition: Has been EBI inspected and certified to be Pristine.  Brand-NEW<br><br>\r\n\r\nThis stunning gown was designed from tulle and has lace and bead applique. Skirt is micro-pleated, and very full. Straps are wide in front and thin out in the back.'),
(1166, 4, 148, 0, 64, '<p>Considering themselves the world&rsquo;s leading bridal house, Pronovias is run by designer and director Manuel Mota of Spain. He and more than seventy others are on the cusp of the hottest and most unique trends, fabrics, styles, etc. Based in Spain, they are known for the lace gowns, and fitted designs.</p>'),
(1167, 4, 129, 0, 64, '<p>EBI inspected and certified to be in pristine condition. Brand-New, never worn.</p>'),
(1168, 4, 133, 0, 64, '<p>Returns accepted. Notify Encore Bridal of intent to return within 7 days from delivery date. Restocking fee may apply. See Return Policy for more information.</p>'),
