(1180, 4, 66, 0, 65, 'Color: Ivory\r\n\r\nFabric: Shantung Thai Silk\r\n\r\nSilhouette: Trumpet\r\n\r\nNeckline: V-neck Halter\r\n\r\nWaist: Natural\r\n\r\nThe gown is the essence of St. Pucchi''s unique design aesthetic. This dress will show off that amazing figure and helps to hid the imperfections with the gathered waist line and placement of the flower appliques. Gracefully show off your back with the gorgeous low back cutout followed beautifully by fabric covered buttons. Includes a built in underskirt.'),
(1181, 4, 148, 0, 65, '<p>President and designer of St. Pucchi, Rani Totman, is known far and wide in the bridal industry for her avant-garde designs that stand out among the masses.  St. Pucchi serves a very specific niche of brides that love a regal look.  St. Pucchi gowns can be seen at the most lavish of weddings.</p>'),
(1182, 4, 129, 0, 65, '<p>EBI inspected and certified to be pristine condition.  Brand-New, never worn.</p>'),
