(1185, 4, 77, 0, 65, NULL),
(1186, 4, 99, 0, 65, NULL),
(1195, 4, 66, 0, 66, 'Color: Ivory\r\n\r\nFabric: 100% silk satin\r\n\r\nSilhouette: ball gown\r\n\r\nNeckline: Strapless\r\n\r\nWaist: Dropped\r\n\r\nTrain: Chapel\r\n\r\nReceipt: yes\r\n\r\nA structured seamed bodice sits atop a voluminous pleated skirt on this regal gown while dazzling faceted crystals accent the dropped waist. A 10 point French bustle has been added. '),
(1196, 4, 148, 0, 66, '<p>Stephen Yearick gowns are for the confident and glamorous bride. Known for his dramatics, Yearick uses exquisite beading with the most intricate detailing. Brides sparkle and shine on their wedding day in these modern designs.</p>'),
(1197, 4, 129, 0, 66, '<p>Has been EBI inspected and certified to be in Pristine condition. Has been altered, but unworn.</p>'),
