(1210, 4, 66, 0, 67, '<p>Color: Off-White</p>\r\n<p>Fabric: Silk Satin</p>\r\n<p>Silhouette: Aline</p>\r\n<p>Neckline: Sweetheart with beaded spaghetti straps</p>\r\n<p>Waist: Dropped</p>\r\n<p>Train: Court</p>\r\n<p>The combination of the intricately draped skirt and beaded detail on the bodice create a look that is dramatic and alluring. Fabric ruching to the low hip has a flattering effect on this gown. Two fabric flowers decorate the skirt for added interest.  <br /> <br /> Shown with the Judith Simon crystal veil, and the MMM "Cassandra" hairpins - sold separately.</p>'),
(1211, 4, 148, 0, 67, '<p>Stephen Yearick gowns are for the confident and glamorous bride. Known for his dramatics, Yearick uses exquisite beading with the most intricate detailing. Brides sparkle and shine on their wedding day in these modern designs.</p>'),
