(5, 'Enable Cookies', 'one_column', NULL, NULL, 'enable-cookies', NULL, '<div class="std">\r\n    <ul class="messages">\r\n        <li class="notice-msg">\r\n            <ul>\r\n                <li>Please enable cookies in your web browser to continue.</li>\r\n            </ul>\r\n        </li>\r\n    </ul>\r\n    <div class="page-title">\r\n        <h1><a name="top"></a>What are Cookies?</h1>\r\n    </div>\r\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website. On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically whenever you visit our site so that we can personalize your experience and provide you with better service. We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes. If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase or take advantage of certain features of our website, such as storing items in your Shopping Cart or receiving personalized recommendations. As a result, we strongly encourage you to configure your web browser to accept cookies from our website.</p>\r\n    <h2 class="subtitle">Enabling Cookies</h2>\r\n    <ul class="disc">\r\n        <li><a href="#ie7">Internet Explorer 7.x</a></li>\r\n        <li><a href="#ie6">Internet Explorer 6.x</a></li>\r\n        <li><a href="#firefox">Mozilla/Firefox</a></li>\r\n        <li><a href="#opera">Opera 7.x</a></li>\r\n    </ul>\r\n    <h3><a name="ie7"></a>Internet Explorer 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Start Internet Explorer</p>\r\n        </li>\r\n        <li>\r\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-1.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Privacy</strong> tab</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-2.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Advanced</strong> button</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-3.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>, put another check mark in the <strong>Always accept session cookies </strong>box</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-4.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-5.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-6.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Restart Internet Explore</p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="ie6"></a>Internet Explorer 6.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\r\n            <p><img src="{{skin url="images/cookies/ie6-1.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> tab</p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>) under <strong>Settings</strong>. Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie6-2.gif"}}" alt="" /></p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="firefox"></a>Mozilla/Firefox</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\r\n            <p><img src="{{skin url="images/cookies/firefox.png"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Expand the <strong>Cookies</strong> section</p>\r\n        </li>\r\n        <li>\r\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="opera"></a>Opera 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\r\n            <p><img src="{{skin url="images/cookies/opera.png"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong> should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong></p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n</div>\r\n', '2011-12-09 21:40:33', '2011-12-09 21:40:33', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'For Brides', 'two_columns_left', NULL, NULL, 'for_brides', NULL, '<p>For Brides Content</p>', '2011-12-10 08:15:11', '2011-12-10 08:50:45', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'Consignors', 'two_columns_left', NULL, NULL, 'consignors', NULL, '<p>Consignors content</p>', '2011-12-10 08:15:35', '2011-12-10 08:51:03', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 'Shipping info', 'two_columns_left', NULL, NULL, 'for_brides/shipping_info', NULL, '<h3>Shipping Policy</h3>\r\n<p>We attempt to ship orders as quickly as possible; usually in 1-3 days; but please allow up to 7 days for an item to ship. We ship through Fedex and USPS at a flat rate based on cost of order total. Flat rate shipping includes postage, direct signature option, packaging, insurance, and a small handling fee. These rates are for the continental US only. Please add $10.00 to all rates for shipment to Alaska and Hawaii.</p>\r\n<h3>Shipping Green</h3>\r\n<p>We attempt to ship our products with as little effect on our planet as possible.  Our efforts include:  using the smallest box possible to ship your order, reusing shipping supplies, reducing the amount of shipping supplies used, and the use of environmentally friendly packaging materials.  Our gowns are shipped in corrugated boxes that are 70% post consumer waste.  Smaller accssories are generally shipped in USPS priority mail boxes which have a cradle to cradle silver certification.  Go to usps.gov for more information.  Please contact us if you have any suggestions on how we can improve in our green effort.</p>\r\n<h3>Domestic Shipping</h3>\r\n<p><strong>Flat Rates for Domestic Shipping</strong></p>\r\n<table border="0" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<th>Order Total</th> <th>Ground</th> <th>Express</th> <th>2 Day</th> <th>Overnight</th>\r\n</tr>\r\n<tr>\r\n<td>$1 - $100</td>\r\n<td>10</td>\r\n<td>25</td>\r\n<td>35</td>\r\n<td>65</td>\r\n</tr>\r\n<tr>\r\n<td>$101 - $200</td>\r\n<td>18</td>\r\n<td>35</td>\r\n<td>55</td>\r\n<td>85</td>\r\n</tr>\r\n<tr>\r\n<td>$201 - $500</td>\r\n<td>22</td>\r\n<td>35</td>\r\n<td>55</td>\r\n<td>85</td>\r\n</tr>\r\n<tr>\r\n<td>$500+</td>\r\n<td>35</td>\r\n<td>65</td>\r\n<td>75</td>\r\n<td>120</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><em>California Residents:&nbsp;A sales tax of 9.75% will be applied to your order</em></p>\r\n<h3>International Shipping</h3>\r\n<ul>\r\n<li>Prices are listed and will be billed in US Dollar.</li>\r\n<li>All international orders are shipped via USPS.</li>\r\n<li>International customers are fully responsible for duties and taxes.  Please contact your local customs office for details on these charges.  Please note that customs delays may be encountered.</li>\r\n</ul>\r\n<h3>Flat Rates for International Shipping</h3>\r\n<p>USPS Priority (6-10 days)</p>\r\n<table border="0" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<th>Order Total</th> <th>Canada</th> <th>All Others</th>\r\n</tr>\r\n<tr>\r\n<td>$1-900</td>\r\n<td>25</td>\r\n<td>36</td>\r\n</tr>\r\n<tr>\r\n<td>$901+</td>\r\n<td>45</td>\r\n<td>56</td>\r\n</tr>\r\n<tr>\r\n<th colspan="3">USPS Global (3-5 days)</th>\r\n</tr>\r\n<tr>\r\n<td>$1-900</td>\r\n<td>40</td>\r\n<td>52</td>\r\n</tr>\r\n<tr>\r\n<td>$901+</td>\r\n<td>70</td>\r\n<td>82</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Encore Bridal currently ships to the following countries:</h3>\r\n<p>Australia, Austria, Bahrain, Belgium, Canada, China, Czech Republic, Denmark, Finland, France, Germany, Greece, Hong Kong, Hungary, Iceland, India, Ireland, Italy, Japan, Jordan, Kuwait, Luxembourg, Malaysia, Monaco, Netherlands, New Zealand, Norway, Philippines, Poland, Portugal, Russia, Saudi Arabia, Singapore, South Africa, South Korea, Spain, Sweden, Switzerland, Taiwan, Thailand, Turkey, United Arab Emirates and the United Kingdom.</p>\r\n<p>If you would like to make a purchase from Encore Bridal and do not reside in one of the boundaries listed above, please contact us.</p>\r\n<p>If you have questions about our shipping policy, please contact us prior to ordering.</p>', '2011-12-10 08:39:40', '2012-06-18 01:20:24', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 'Return Policy', 'two_columns_left', NULL, NULL, 'for_brides/return_policy', NULL, '<h3>E-Boutique Return Policy</h3>\r\n<p>Yes, we accept returns for all of our bridal gowns and accessories!  Unlike most listing sites, auction sites, and consignment stores, we have a generous return policy.  Encore Bridal wants you to have the dress of your dreams.  So, if the wedding dress or bridal accessory you ordered doesn&rsquo;t make you feel your best, send it back.  Just make sure that it meets the following guidelines:</p>\r\n<h3>Return Guidelines:</h3>\r\n<p>Contact us within seven (7) days of receiving your item and inform us of your intention to return, or exchange.  You will then receive a response from us within 24 hours with a return authorization number.  If you do not receive a response from us within that time frame, your message was not received.</p>\r\n<p><strong>All sales are final following 7 days of receipt if a return authorization number has not been issued.</strong></p>\r\n<p>Once you receive a return tracking number, ship the item back to us (we do not pay for return shipping or insurance) ensuring that we receive the item within 7 days of receiving your authorization number.  If we do not receive the item within 7 days, it will be refused and shipped back to you at your cost without the refund.</p>\r\n<p><strong>Wedding Dresses:</strong> If the item is returned in its original condition, without evidence of wear, staining, alterations or damage; we will reimburse you the original cost of the gown, minus your original shipping cost and a 5% restocking fee.</p>\r\n<p><strong>Bridal Accessories:</strong> If the item is returned in its original condition, without evidence of wear or damage, you will receive a full refund (minus original shipping costs).</p>\r\n<p><strong>Exchanges:</strong> Don&rsquo;t pay shipping on exchanges!  If you choose to exchange your item for another in our catalog, you will not have to pay shipping to have the new item sent to you.</p>\r\n<p>Please note that colors shown in the photographs may not accurately reflect the color of the dress or accessory.  In addition, please understand that we do our best to accurately describe each item and its condition following a thorough inspection.  However, small omissions may be made.  We may not refund the stocking fee for such small omissions.</p>\r\n<p>Purchases completed in our showroom may be subject to a different return policy.</p>', '2011-12-10 08:40:08', '2012-06-18 01:21:32', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 'Alterations', 'two_columns_left', NULL, NULL, 'for_brides/alterations', NULL, '<h2>Tips on Wedding Gown Alterations</h2>\r\n<p>Most wedding dresses will need to be altered to make sure the fit is perfectly customized to you. The following are FAQs regarding wedding gown alterations as well as a list of recommended alterations shops.</p>\r\n<p><strong>The gown I like is too big/too small, how much can it be altered to fit?</strong><br /> Usually bridal gowns can be altered 2-3 sizes smaller and possibly 1 size larger, depending on the seam allowance. Please note that some fabrics (ex. satin) will show the stitch marks if let out. Consult a seamstress prior to purchasing a gown that may need to be made larger.</p>\r\n<p><strong>What usually needs to be altered?</strong><br /> There are mainly three types of alterations completed- shortening the hemline, taking in the bodice, and shortening the sleeves. In addition, if your gown has a train, you will need to have a bustle created.</p>\r\n<p><strong>How do I find someone to alter my wedding gown? </strong><br /> Seek someone who specializes in altering high-end wedding dresses. Ask for referrals from newly married friends and look on review sites such as Yelp. Call the recommended alterations shops and ask about their experience. See below for our recommendations.</p>\r\n<p><strong>How much does it cost?</strong><br /> Cost for alterations varies widely depending on what you&rsquo;d like to have done and the going rates in your area. It could cost as little as $80 and could be as much as $600. Get an estimate of the total cost prior to having your gown altered.</p>\r\n<p><strong>How much time does it take to have a wedding dress altered?</strong><br /> Plan on 2-6 weeks depending on the work that needs to be done. You typically need to have 3 fittings. The first and second fittings determine what needs to be done and how the alterations that have been made look on you. The final fitting should take place 1-2 weeks before your wedding and should include any final tweaks that need to be made.</p>\r\n<p>&nbsp;</p>\r\n<h3>Recommended Alterations Shops:</h3>\r\n<p><strong>LOS ANGELES AREA:</strong><br /> <strong>Coco''s Alterations</strong><br /> 815 Torrance Blvd<br /> Redondo Beach, CA 90277<br /> 310.316.0837<br /> Lynda Valenti<br /> North Hills, 818.360.9943</p>\r\n<p><strong>PHILADELPHIA:</strong><br /> <strong>Nilah &amp; Co.</strong><br /> 1104 Ormond Avenue<br /> Drexel Hill, PA 19026<br /> Phone: 610.853.9822<br /> <a href="http://www.nilah.com">www.nilah.com</a></p>\r\n<p><strong>ORLANDO AREA:</strong><br /> <strong>Tears of Joy Seamstress Services - Holly Smith</strong><br /> 4194 Conroy Road, Suite 103 (inside Solutions Bridal)<br /> Orlando, FL 32839<br /> Phone: 407.760.4886<br /> <a href="http://www.tearsofjoy.com">www.tearsofjoy.com</a></p>', '2011-12-10 08:40:33', '2011-12-21 06:40:04', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 'Cleaning', 'two_columns_left', NULL, NULL, 'for_brides/cleaning', NULL, '<h2><img src="{{media url="wysiwyg/feature.jpg"}}" alt="" /></h2>\r\n<h2>Wedding Dress Cleaning &amp; Preservation</h2>\r\n<p>Now serving brides nationwide!</p>\r\n<p>After &ldquo;I Do&rdquo;</p>\r\n<p>You put your heart and soul into every detail of your wedding; the place, the flowers, the food, the music, and most importantly, your perfect dress.  Now what?  Well, think twice before dropping that gown at your local dry cleaner.  Proper wedidng dress cleaning and preservation is much more involved than you may think.</p>\r\n<p>Encore Bridal is delighted to announce that we are now providing museum quality and eco-friendly wedding dress cleaning from one of the leading wedding dress cleaners and preservation companies in the country. You can trust that your dress will be fully and properly cleaned with us - every spot will be attended to.  All gowns are <strong>hand cleaned and pressed</strong>. No machines!</p>\r\n<p>All cleaning supplies used are non-toxic and purchased from a museum supplier. They either <strong>meet or exceed</strong> the United States Congressional standard for preservation.</p>\r\n<h3>About our Cleaning:</h3>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Your entire gown is spot cleaned, inside and out, to remove stains, oils and soils.</li>\r\n<li>A specialized wet cleaning process is used based on your gown''s age, color and fabric, and your gown is hand cleaned - no machines used.  All wedding dresses are cleaned separately - not mass cleaned.</li>\r\n<li>Your gown is air dried to protect any beads, pearls or sequins from harmful heat.</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<h3>About Gown Preservation:</h3>\r\n<p>After pressing, your wedding dress is placed in a specially designed archival museum preservation box, which is acid free, lignin free and buffered.</p>\r\n<p>The boxes are not sealed so you can enjoy your gown as often as you wish.</p>\r\n<p>The preservation procedures and materials used keep your wedding gown ready to wear for up to 300 years!</p>\r\n<h3>Why Avoid The Dry Cleaner?</h3>\r\n<p>Many dry cleaners:</p>\r\n<ul>\r\n<li>Do not protect beading, buttons and the like-- which often dissolve, soften, and/or dull in most dry cleaning solutions. </li>\r\n<li>Do not clean and care for gowns individually.  Your gown will be cleaned in a machine with other gowns, with no particular attention to stains, marks, and needed repairs. </li>\r\n<li>Use toxic chemicals that are harmful to the environment.</li>\r\n<li>Purchase their supplies from a cleaning distributor who has no training or knowledge of preservation.  The boxes they use are simply &ldquo;pretty cardboard boxes&rdquo; or &ldquo;acid free chambers&rdquo; which will not preserve gowns long-term.</li>\r\n<li>Do not guarantee their cleaning and preservation methods. </li>\r\n<li>Some dry cleaners even put an additional film over the box, which they may call hermetically sealing the box.  THE BOX SHOULD NEVER BE SEALED IN THIS MANNER AS IT PROMOTES MILDEW GROWTH.</li>\r\n</ul>\r\n<p>Encore Bridal and Forever Treasured guarantee our cleaning and preservation service and take responsibility for your wedding gown from the time it is received in our plant until you open it 10, 20, or 30 years from now.  This is providing you adhere strictly to the care and storage guidelines.</p>\r\n<h3>Prices:</h3>\r\n<p>Prices vary depending on fabric, style, and amount of dirt.  The price range for wedding gown cleaning AND preservation is $310-$420.  If requested, we can repair buttons, rips, tears, and broken bustles for a small extra charge.  We also preserve and/or clean veils, shawls, christening and flower girl dresses, bolero jackets, and slips.</p>\r\n<p><strong>Contact us today:</strong> <a href="mailto:info@encorebridal.com">info@encorebridal.com</a> or 310.545.1409</p>\r\n<p>We thank you for entrusting us with your most priceless garment.</p>', '2011-12-10 08:40:59', '2011-12-22 12:07:12', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 'Layaway', 'two_columns_left', NULL, NULL, 'for_brides/layaway', NULL, '<h3>Encore Bridal Layaway Program</h3>\r\n<p>Can&rsquo;t pay for your dress in full today? We have 2 options that will allow you to pay over a 30 or 90 day period. Unlike credit cards, this is interest free! We provide this service for your convenience and simply to make life a little easier. Here&rsquo;s how it works:</p>\r\n<ul>\r\n<li>Minimum order is $1000 (this does not include tax if applicable, shipping, or processing fee).</li>\r\n<li>There is a one time processing fee of $25 for online purchases, and $75 for showroom purchases, that is non-refundable. </li>\r\n<li>Initial and installment payments can be made via PayPal (julie@encorebridal.com), personal check, money order, or by calling us with your Visa, MasterCard, or Discover card information.</li>\r\n</ul>\r\n<h3>30-day Layaway Program</h3>\r\n<ul>\r\n<li>5% of the price of the item is required as a deposit + processing fee. This initial deposit and processing fee are NON-REFUNDABLE. </li>\r\n<li>This deposit, when received and cleared, will hold your dress for you for 30 days. As such, the posting of your dress will be de-activated in the e-Boutique. </li>\r\n<li>You can make as many payments as you wish within the 30 day period. </li>\r\n<li>At the end of 30 days you will receive a notice of your final balance due, + tax (if shipping in California), + shipping. The final payment must be made via PayPal or major credit card (no checks). </li>\r\n<li>Once complete payment is received, the item will ship within 1-3 business days. The normal return policy applies. Buyer is responsible for reviewing this return policy prior to agreeing to the layaway program.</li>\r\n</ul>\r\n<h3>90-day Layaway Program</h3>\r\n<ul>\r\n<li>15% (or more) of the price of the item is required as a NON-REFUNDABLE deposit + processing fee. </li>\r\n<li>This deposit, when received and cleared, will hold your dress for you until the first installment is due. As such, the posting of your dress will be de-activated in the e-Boutique.</li>\r\n<li>The first payment installment of 15% (of the balance) is due within 30 days of the initial deposit and the second payment installment of 30% (of the balance) is due within 60 days. You are welcome to pay more than what is required. The installments can be paid via PayPal, personal check, money order, or major credit card. You are responsible for timely payment whether or not you receive a reminder email from Encore Bridal. All payments made are NON-REFUNDABLE and NON-TRANSFERABLE. </li>\r\n<li>At the end of 90 days you will receive a notice of your final balance due + tax (if shipping in California) + shipping. The final payment must be made via PayPal or major credit card (no checks). </li>\r\n<li>Once complete payment is received, the item will ship within 1-3 business days. This is a final sale and no returns will be accepted.</li>\r\n</ul>\r\n<h3>Layaway Cancellation Policy</h3>\r\n<p>You may cancel your layaway within 48 hours of the initial deposit for a refund minus the layaway processing fee. After 48 hours, the initial deposit is non-refundable.</p>\r\n<p><strong>Defaulted Layaways:</strong> If timely payment is not received you forfeit your payments in full (No Refunds). All items placed on layaway will be made available for public purchase.</p>\r\n<p><strong>Reinstatement of a Defaulted Layaway:</strong> If the item has not been sold, returned to the consignor or placed on layaway by another bride, the original layaway program can be re-instated for an additional fee of $25 plus payment in full.</p>\r\n<p>To place an item on layaway or for questions about our layaway program contact us at <a href="mailto:info@encorebridal.com">info@encorebridal.com</a> or 310.545.1409</p>', '2011-12-10 08:44:45', '2012-06-18 01:23:13', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(13, 'Condition Guidelines', 'two_columns_left', NULL, NULL, 'for_brides/condition_guidelines', NULL, '<h2>The EBI Inspection Program &amp; Our Worry-Free Promise</h2>\r\n<p>We thoroughly inspect all wedding gowns prior to accepting them for consignment to ensure that there is minimal evidence of wear and damage, and that worn gowns have been professionally cleaned. Some of our samples have been cleaned while others may require spot cleaning. All gowns receive an EBI condition rating and certification at time of the initial inspection.  We''ve noted this in our description of the gown under "condition". Encore Bridal only accepts gowns in <strong>GOOD</strong> to <strong>PRISTINE</strong> condition, but we''ve described all of the condition levels below. While we make every effort to keep gowns in their original condition (washing hands before touching, using make-up covers etc...), they may have been tried on since the initial inspection.  Thus, the condition can change and may not always be updated. Don''t worry, we RE-INSPECT all items prior to shipping and inform you if there has been a change in condition.  You then have the option of canceling your order.</p>\r\n<p><strong>PRISTINE/ LIKE-NEW:</strong> Self-explanatory</p>\r\n<p><strong>EXCELLENT:</strong> Excellent items are considered ready to walk down the aisle. A few minor imperfections (UP TO 3) in discrete locations may be noted which DO NOT compromise the item. Such imperfections may include a few snags in the fabric, a few missing beads, faint dust at the hem etc... Such imperfections are not considered readily noticeable, but may be seen if closely inspected by you.</p>\r\n<p><strong>VERY GOOD:</strong> Gowns in very good condition may require minor cleaning and repair; but also wearable as-is. Several minor imperfections (UP to 4) have been noted which do not compromise the item. These gowns may have small faint marks, have notable missing beads, several snags in the fabric etc..., which are generally in a discrete location (ie. not on the bodice or front skirt).</p>\r\n<p><strong>GOOD:</strong> Noted minor imperfections (Up TO 5) which are generally in a discrete location. Will require a little care and attention prior to walking down the aisle. Most likely repairable, but may have some minor stains that could not be removed.</p>\r\n<p><strong>FAIR:</strong> A few noted imperfections (ex. broken zipper) or many minor imperfections. Will require care and attention prior to walking down the aisle. Most likely repairable, but may have some stains that could not be removed.</p>\r\n<p><strong>POOR:</strong> Unlikely wearable again. Parts of it may be used to make a new gown (ex. beading).</p>\r\n<p><strong>Our Worry-Free Promise:</strong> We inspect gowns prior to adding them to our e-Boutique and again prior to shipping. Only gowns that are AUTHENTIC and meet our high-level condition standards are added to our e-Boutique. The condition of the gown is listed in the gown description. We attempt to fully disclose all evidence of wear, tear, and damage. We want all of our brides to be thrilled with the gown they purchased from Encore Bridal. If once received you note the condition rating of the gown was mis-represented we will not only provide a full refund (should you choose to return it), but will send you a $25 gift card to reimburse you for your time. Please note that we sell pre-owned wedding dreses and accessories, so most gowns will not be in perfect, straight from the manufacturer condition.</p>', '2011-12-10 08:46:54', '2011-12-21 08:43:47', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(14, 'Form', 'two_columns_left', NULL, NULL, 'consignors/form', NULL, '<p>Form content</p>', '2011-12-10 08:48:06', '2011-12-21 08:56:57', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(15, 'Showroom', 'two_columns_left', NULL, NULL, 'about/showroom', NULL, '<p>Showroom content</p>', '2011-12-10 08:48:29', '2011-12-27 07:59:11', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(16, 'Measurement Info', 'two_columns_left', NULL, NULL, 'measurement_info', NULL, '<p>Measurement info content</p>', '2011-12-10 08:49:01', '2012-02-07 09:41:38', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(17, 'Privacy Policy', 'one_column', NULL, NULL, 'measurement_info/privacy_policy', NULL, '<h3>Privacy Policy</h3>\r\n<p>All information collected on this site, including contact information, is the exclusive property of EncoreBridal.com. No customer information is sold, shared, rented, or transmitted in any way to parties outside of the organization. The customer understands that EncoreBridal.com does collect personal information when an order is placed online. This information includes, but is not limited to:</p>\r\n<ul>\r\n<li>Customer name</li>\r\n<li>Customer shipping and billing address</li>\r\n<li>Customer telephone number</li>\r\n<li>Customer credit card type, number, and expiration date</li>\r\n<li>Customer IP address</li>\r\n</ul>\r\n<h3>Newsletter and Promotion</h3>\r\n<p>EncoreBridal.com provides as a service to customers the option to receive promotional email no more than 2 times per month through an opt-in and opt-out subscription. Customers must opt-in for this selection and are given the opportunity to opt-out at any time.</p>\r\n<h3>Website Security</h3>\r\n<p>EncoreBridal.com makes use of state-of-the-art encryption technology through Secure Socket Layer (SSL) to protect customer information. Please note the SSL in the URL when placing an order with EncoreBridal.com.</p>\r\n<h3>Links to Other Websites</h3>\r\n<p>EncoreBridal.com contains links to outside websites. The organization does in no way endorse these sites, or take responsibility for the privacy practices of these sites. We strongly encourage all shoppers to read the privacy policies for each individual site before shipping.</p>\r\n<h3>Share-With-A-Friend Feature</h3>\r\n<p>A user may elect to refer a friend to our website utilize the Share-With-A-Friend feature located on individual item pages. EncoreBridal.com will request the name and email address solely for this purpose and will senda one-time only email to the referral. The referral&rsquo;s personal information will not be stored or used for any other purposes.</p>\r\n<h3>Changes to Our Privacy Policies</h3>\r\n<p>As our business changes so may aspects of our Privacy Policy. Privacy Policy updates will be posted here. Policies directly affecting customer personal information will always remain in effect, and only policies that further enhance the security and privacy of our customers will be added to this policy.</p>', '2011-12-10 08:49:44', '2012-06-15 03:54:57', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(18, 'Preferred Vendors', 'two_columns_left', NULL, NULL, 'for_brides/preferred_vendors', NULL, '<p><span style="font-size: 12px; font-weight: normal;">Wedding Professionals &amp; Resources We Love. &nbsp;We highly recommend the following:</span></p>\r\n<h3>Green Wedding Resources</h3>\r\n<ul>\r\n<li><a href="http://www.thegreenbrideguide.com/" target="_blank">The Green Bride Guide.com</a></li>\r\n<li><a href="http://www.portovert.com/" target="_blank">PortoVert.com</a></li>\r\n</ul>\r\n<h3>Bridesmaid Dresses</h3>\r\n<ul>\r\n<li><a href="http://www.bellabridesmaid.com/" target="_blank">Bella Bridesmaid</a> - 42 Locations throughout the US</li>\r\n</ul>\r\n<h3>Bridal Consultants</h3>\r\n<ul>\r\n<li>Michelle Barrionuevo-Mazzini - <a href="http://www.mbweddingdesigns.com/" target="_blank">MB Wedding Designs</a></li>\r\n<li>Katie Tiffany, <a href="http://www.tiffany-weddings.com/" target="_blank">Tiffany Weddings</a></li>\r\n<li>Ida Gardner, <a href="http://www.idagardnerevents.com/" target="_blank">Ida Gardner Events</a></li>\r\n</ul>\r\n<h3>Wedding Rings</h3>\r\n<ul>\r\n<li><a href="http://www.bluenile.com/" target="_blank">Blue Nile</a></li>\r\n<li>Claudia Endler, <a href="http://www.claudiaendler.com/" target="_blank">Claudia Endler Designs</a></li>\r\n</ul>\r\n<h3>Photographers</h3>\r\n<ul>\r\n<li>Mimi Teller, <a href="http://www.mimiphoto.com/" target="_blank">Mimi Teller Photography</a></li>\r\n<li>Vanessa Presioze, <a href="http://www.vpphotography.com/" target="_blank">Vanessa Presioze Photography</a></li>\r\n<li>Dina Douglass, <a href="http://www.andrenaphoto.com/" target="_blank">Andrena Photography</a></li>\r\n<li>Aaron Gill, <a href="http://www.fotonuova.com/" target="_blank">FotoNuova</a></li>\r\n</ul>\r\n<h3>Music/Entertainment</h3>\r\n<ul>\r\n<li><a href="http://www.thecheeseballs.com/" target="_blank">TheCheeseballs.com</a>, Northern California</li>\r\n<li><a href="http://www.aceofhearts.net/" target="_blank">AceofHearts.net</a>, Southern California</li>\r\n</ul>\r\n<h3>Cake &amp; All Things Sweet</h3>\r\n<ul>\r\n<li><a href="http://www.cakebakeshop.com/" target="_blank">Cake Bakeshop</a>, Manhattan Beach, CA</li>\r\n<li><a href="http://www.nkconfections.com/" target="_blank">Nancy Kay''s Confections</a>, Los Angeles, CA</li>\r\n</ul>\r\n<h3>High-End Consignment Clothing Boutiques</h3>\r\n<ul>\r\n<li><a href="http://www.theaddressboutique.com/" target="_blank">The AdDress</a>, Santa Monica, CA</li>\r\n<li><a href="http://www.greatlables.com/" target="_blank">Great Labels</a>, Santa Monica, CA</li>\r\n</ul>\r\n<h3>Personal Stylists To Assist With Your Trousseau</h3>\r\n<ul>\r\n<li>Jennifer Margolin, <a href="http://jennifermargolin.com/" target="_blank">JenniferMargolin.com</a></li>\r\n<li>Viviana Rueda, <a href="http://www.vivendifashionista.com/" target="_blank">VivendiFashionista.com</a></li>\r\n</ul>\r\n<h3>We are proudly listed on the following sites:</h3>\r\n<ul>\r\n<li><a href="http://www.topweddingsites.com/" target="_blank">TeamWedding.com</a> - Home of the Top Wedding Sites&trade;</li>\r\n<li><a href="http://www.onewed.com/" target="_blank">Onewed.com - Wedding planning guide. </a> Find local wedding photographers, wedding planners, and so much more!</li>\r\n<li><a href="http://www.weddepot.com/" target="_blank">WedDepot.com</a> - Wedding Social Network</li>\r\n</ul>', '2011-12-21 08:53:28', '2012-06-18 01:25:58', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
