(21, 'Cleaning', 'two_columns_left', NULL, NULL, 'consignors/cleaning', NULL, '<p>Cleaning information for consignors</p>', '2011-12-21 09:01:10', '2011-12-21 09:01:21', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(22, 'Press', 'two_columns_left', NULL, NULL, 'about/press', NULL, '<p>Press Information</p>', '2011-12-21 09:04:24', '2011-12-27 07:51:10', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(23, 'Events', 'two_columns_left', NULL, NULL, 'about/events', NULL, '<h2>Sunday Style Salons</h2>\r\n<p>For the convenience of local brides, we open our Manhattan Beach showroom on the second and last Sundays of every month. Come view all of the in-stock discounted bridal gowns and bridal accessories currently in our e-Boutique. Our dressing room will be open.  A special guest will be in attendance on various months to provide style inspiration. Sip champagne, connect with other brides, and become inspired!</p>\r\n<p><strong>When:</strong><br /> Now EVERY Sunday from 11am - 4pm.  Our LAST Sunday Style Salon in Manhattan Beach will be Dec. 4th. Missed it?  Check out or "Last Chance Days" below.</p>\r\n<p><strong>Where:</strong> <br /> Encore Bridal showroom<br /> 3215 Highland Ave (at 33rd street) <br /> Manhattan Beach, California</p>\r\n<p>*We''re sorry, it is street metered parking only.</p>\r\n<p>Walk-ins welcome; no appointment necessary.  We look forward to meeting you!</p>\r\n<p>&nbsp;</p>\r\n<h2>Last Chance Days</h2>\r\n<p>Encore Bridal is moving to San Francisco!  Our Manhattan Beach showroom will be open December 9th - December 13th by appointment.  LA brides this is your LAST CHANCE to view our collection in person. We are offering FREE VIB (very important bride) appointments on these days.</p>\r\n<p>Contact us today for an appointment - 310.545.1409 or <a href="mailto:Julie@encorebridal.com">Julie@encorebridal.com</a></p>\r\n<p>A big thank you to all of our Southern California brides for your support.  We look forward to continuing our service to you through our e-Boutique.</p>', '2011-12-21 09:04:29', '2011-12-21 09:07:14', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(24, 'Beyond Bridal', 'two_columns_left', NULL, NULL, 'about/beyond_bridal', NULL, '<h2>Beyond Bridal</h2>\r\n<p>We not only want to help women find the wedding gown of their dreams, we want to help all women live happier, healthier lives.  A portion of our profit from every sale is donated to non-profit organizations that support cervical cancer research and education.  Currently we are making donations to <a href="http://www.tamikaandfriends.org/" target="_blank">Tamika and Friends Inc.</a></p>\r\n<p>For more information about Cervical Cancer and HPV visit:<br /> <a href="http://www.tamikaandfriends.org/" target="_blank">Tamika and Friends Inc.</a><br /> <a href="http://www.nccc-online.org/" target="_blank">National Cervical Cancer Coalition</a><br /> <a href="http://www.cancer.gov/" target="_blank">The National Cancer Institute</a><br /> <a href="http://www.cdc.gov/" target="_blank">The Center for Disease Control</a></p>', '2011-12-21 09:09:58', '2011-12-21 09:10:21', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(25, 'Reviews', 'two_columns_left', NULL, NULL, 'reviews', NULL, '<p>Testimonial Information</p>', '2011-12-21 09:11:44', '2012-06-18 01:28:39', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
