(26, 'Terms of Service + Use', 'two_columns_left', NULL, NULL, 'measurement_info/terms_of_use', NULL, '<h3>Terms of Use</h3>\r\n<p>Encore Bridal is offered to you, the user, conditioned on your acceptance of the terms, conditions and notices contained or incorporated by reference herein and such additional terms and conditions, agreements and notices that may apply to any page or section of the Site.</p>\r\n<h3>Overview</h3>\r\n<p>Your use of this Site constitutes your agreement to all such terms, conditions and notices. Please read them carefully. By using this Site, you agree to these Terms of Use ("Terms of Use"), as well as any other terms, guidelines or rules that are applicable to any portion of this Site, without limitation or qualification. If you do not agree to these Terms of Use, you must exit the Site immediately and discontinue any use of information or products from this Site.</p>\r\n<h3>Limitation of Liability</h3>\r\n<p>At Encore Bridal we offer high-end designer dresses and accessories. We proudly stand behind the authenticity of our goods. In most instances, these goods are not obtained directly from the designers and we are not the original owners. In this regard, Encore Bridal expressly disclaims any indication that it is an authorized dealer or agent of any of the designers whose goods are offered on this site.<br /><br /> In addition, Encore Bridal disclaims any implied representation or warranty with regard to this site or its contents, including the merchandise offered on this site. Encore Bridal uses every effort to insure that product information provided is accurate. This site, its contents, and all merchandise is provided on an "as Is" basis. You expressly agree that your use of this site is at your sold risk. Encore Bridal will not be liable for any damages of any kind arising from this site, including, but not limited to direct, indirect, incidental, punitive or consequential damages.<br /><br /> Encore Bridal reserves the right to refuse an order for any reason. Occasionally, there may be information on the site that contains unintentional typographical errors, inaccuracies, or omissions that may be related to product descriptions, pricing, promotions, offers, and availability. Encore Bridal reserves the right to correct any errors, inaccuracies, or omissions and to chage or update information or cancel orderes if any inofrmation is inaccurate at any time without prior notice (including after an order has been submitted.<br /><br /> We have made every effort to display the colors of our products that appear at the Site. However, as the actual colors you see will depend on your monitor, we cannot guarantee that your monitor''s display of any color will be accurate.</p>\r\n<h3>Copyright Notice</h3>\r\n<p>By using this site, you acknowledge that this site contains content, text, images and other materials that are protected by U.S. copyright laws and therefore, may not be used except with our express written consent. Unless otherwise agreed in writing by us, you may not copy or display or post any content, text, images or other materials offered via this Site on any network computer, website, bulletin board or any other publicly accessible medium. You must keep intact, and may not remove or alter, any copyright or other proprietary notices on any content, text, images or other materials offered via this Site.</p>\r\n<h3>Modification of the Site and These Terms and Conditions</h3>\r\n<p>Encore Bridal reserves the right to change, modify, alter, update or discontinue the terms, conditions and notices under which this Site is offered and the links, content, information, prices and any other materials offered via this Site at any time and from time to time without notice or further obligation to you except as may be provided therein.</p>', '2011-12-21 09:17:21', '2012-06-18 01:14:23', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(27, 'Customer Service', 'two_columns_left', NULL, NULL, 'measurement_info/customer_service', NULL, '<h3>About Our Products</h3>\r\n<p>Encore Bridal sells pre-owned wedding dresses and bridal accessories from today''s most sought after designers at a significant discount.  Most of the products on our site and in our showroom are owned by individuals, bridal salons, or designers and are being sold on a consignment basis. For your benefit, Encore Bridal is not a listing service but a bridal consignment and resale e-Boutique.  Thus, all wedding gowns and most accessories sold are stored in the Encore Bridal showroom and are inspected by Encore Bridal to verify authenticity and condition.  Being a bridal consignment and resale boutique also insures that all of our customers receive the consistent excellent customer service.</p>\r\n<h3>Product Availability and Pricing</h3>\r\n<p>For the most part, we only have one of each wedding dress and accessory. Therefore, when an item sells it is either listed as "Sold Out" or deactivated from our online store. We are not exactly sure when a pre-owned wedding dress or accessory style will become available to us, however, you are welcome to contact us with the style and size you are looking for and we will be happy to let you know if it arrives. In addition, you can be notified of all new arrivals and price reductions by joining our Facebook Page.<br /><br /> Prices are determined by the age, style, and condition of an item.  We attempt to price items fairly for both the consignor and our brides.  I''m sorry, we do not negotiate pricing. We may however reduce the price of items periodically.</p>\r\n<h3>Savvy-Bride Package</h3>\r\n<p>If you purchase a wedding gown and 3 accessories you will receive 10% off your entire order. To receive this discount you must contact us in advance of submitting your order - Info@encorebridal.com.  We will subsequently send you a payment request for the total owed reflecting this discount.<br /><br /> Please note our inventory is available both through this site and in our showroom.  Once an item sells in our showroom every effort is made to promptly deactivate it or list it as sold out.  Occasionally an item may have sold in our showroom prior to us being able to list it as such on this site. If this occurs we will contact you and issue a full refund.  We are sorry for any inconvenience this may cause.<br /><br /> Infrequently data, including prices, may be inaccurately displayed on our site due to system or typographical errors. While we make every atempt to avoid these errors, they may occur.  We reserve the right to correct any and all errors when they do occur and we do not honour inaccurate or erroneous prices. If a product''s listed price is lower than its actual price, we will, at our discretion, either contact you for instructions before shipping or cancel the order and notify you of such cancellation. If the order has been shipped, you agree to either return the product or pay the difference between the actual and charged prices.  We apologize for any inconvenience that this may cause.</p>\r\n<h3>Cancelled Orders</h3>\r\n<p>Orders may be cancelled within 24 hours of being submitted (provided it has not already shipped) less a 5% processing fee.  After 24 hours, the order is final and will be shipped.  Returns are accepted.  Please see our return policy.</p>\r\n<h3>Shipping</h3>\r\n<p>Gowns and accessories are shipped within 1-5 days of payment unless otherwise indicated in the product description.  We ship both within the United States and Internationally at a flat rate.  For more information about our shipping rates and countries we are currently shipping to, please see our shipping information.</p>\r\n<h3>Colors</h3>\r\n<p>Every designer has different names for the colors they use for their gowns.  We are not always apprised of the designer''s color description.  Thus, we often will use a color description (ex. off-white, light ivory, ivory, champagne) that is most widely accepted and understood.  Please note, the actual colors you see will depend on your monitor, we cannot guarantee that your monitor''s display of any color will be accurate.</p>\r\n<h3>Worry Free Promise</h3>\r\n<p>We want you to shop with confidence.  We guarantee all of the items being sold by Encore Bridal are 100% authentic and are in the condition stated (good, excellent, pristine, etc...) prior to shipment. We inspect our gowns upon receipt, again when taking the photos and prior to shipment.  At time of shipping, if a wedding gown or accessory is not in the condition stated in the product description you will have the option of cancelling your order for a full refund. Likewise, if you receive an item from us and it is not in the condition stated by us at time of shipping, we will give you a full refund and a $25 gift card for any inconvenience this may have caused.</p>', '2011-12-21 09:22:06', '2012-06-18 01:17:54', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
